INSERT INTO `hotel` (`id`, `townId`, `name`, `video`, `photos`, `expert`, `excellence`, `termsOfPayment`, `services`, `mainReadings`, `secondaryReadings`, `sorting`, `cancelNoPenalty`, `cancel30Penalty`, `cancel100Penalty`, `star`, `top`, `requestCount`, `commentCount`) VALUES
(6, 10, 'Санаторий Aquamarina', '', '["1 (1).jpg","1 (2).jpg","1 (3).jpg","1 (4).jpg","1 (5).jpg"]', 'В центре курорта Карловы Вары на набережной реки Теплы находится небольшой уютный санаторий с почти морским названием Aquamarin. Санаторий был открыт после реконструкции по проекту архитектора Бретислава Кубичка. Санаторий находится напротив Мельничной колоннады, что дает прекрасную возможность для отдыхающих пить минеральную воду и неторопливо прогуливаться по набережной реки.\r\n', 'Санаторий Aquamarin — 25 уютных номеров, один апартамент, два номера системы «интерконект» (соединенные между собой номера), два номера класса «эконом». Во многих номерах — балкон или терраса, где можно полюбоваться панорамами города. В номерах: ванная, фен, мини-бар, спутниковое ТВ с российскими программами, сейф, выход в интернет, халаты, тапочки.\r\n\r\nК услугам гостей — косметические наборы, швейные принадлежности, средства ухода за обувью. Стильная обстановка и украшение номеров — точные копии коллекций, изготовленных испанскими мастерами, которые трудились в президентском дворце в Праге. Мебель в номерах — знаменитой итальянской фирмы «SKAPINI”.\r\n\r\nCheck-in: в 14.00\r\nCheck-out: в 12.00\r\nLate Check-out: до 18.00 — оплата 50% стоимости номера.', '', 'Санаторий Aquamarin имеет свой бальнеоцентр, где вы можете пройти курс курортного лечения, дежурный врач назначит вам питьевой курс и лечебные процедуры. Диабетикам может быть назначено диетпитание, второй завтрак или полдник.Виды процедур: ванны — жемчужная, вихревая, с добавками, с минеральной солью, вибрационная, с травами и растительными экстрактами ( хмелевые, розмариновые, эвкалиптовые, апельсиновые, липовые, лавандовые, с каледулой и др.), гидроксер, массажи — подводный, классический, рефлекторный, ароматический, углекислая сухая ванна, акопрессура, кислородная терапия, газовые уколы, магнитотерапия, лимфодренаж, лазер последнего поколения, электролечение, ингаляции минеральной водой, аромотерапия, индивидуальная лечебная гимнастика, групповая реабилитационная гимнастика в бассейне, финская и турецкая сауны, фито-бар, ресторан, кафе.\r\n\r\nЛечение ежедневно:\r\n\r\n Понедельник — пятница с 7.00 до 19. 00\r\n Суббота с 8.00 до 12.00\r\n Воскресенье — выходной\r\n\r\nК услугам отдыхающих бассейн (5 х 10м) с противотоком и массажными струями. Сухую или турецкую сауну можно посещать в удобное для вас время. В фитобаре вы можете выпить свежевыжатый сок, различные травяные чаи, витаминные коктейли, бодрящий кофе и какао.\r\n\r\nЕсли вы приехали на авто, отель предоставит место для парковки.\r\n\r\nВ ресторане в центре зала находится камин с механической системой вращения гриля.  Обслуживающий персонал окружит вас своей заботой и предусмотрительностью, вы ощутите почти семейную атмосферу уюта и покоя.', '', '', NULL, 20, 15, 10, 4, 0, 0, 0),
(7, 10, 'Астория', '', '["2 (1).jpg","2 (2).jpg","2 (3).jpg","2 (4).jpg","2 (5).jpg"]', 'Курортный отель «Астория» - санаторий в самом центре курортной зоны Карловых Вар,\r\nнапротив Колоннады с источниками.\r\n\r\nОтель состоит из пяти зданий, реконструированных по последнему слову техники, и выглядит единым комплексом. «Астория» принимает клиентов в течение  всего года на отдых и лечение, дети — с 12 лет.', 'К услугам отдыхающих отель располагает 100 уютными одноместными и двухместными номерами. В номерах — комфортная ванна или душ, туалет, телефон, холодильник,фен, можете послушать радио и посмотреть телевизор с российскими программами.\r\n\r\nУборка номера — ежедневная, 2 раза в неделю смена полотенец.\r\n1 раз в неделю — смена белья.\r\nЗаселение — с 12.00\r\nОсвобождение номера в 10.00', 'Вы платите по прибытии в Спа отель Астория.\r\n\r\nСпа отель Астория осуществляет временное блокирование 20% стоимости заказа на вашей банковской карте за 28 дней до заезда. Сумма физически не снимается с карты, а только временно блокируется на случай, если вами будет произведена отмена бронирования уже в период действия штрафных санкций.\r\n\r\nСпа отель Астория принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Санаторий оборудован современным диагностическим оборудованием, лечебные процедуры — только в корпусе санатория. Санаторий имеет свой источник с минеральной водой,  подведенный в бальнеологический комплекс.\r\n\r\nЕжедневно клиентам предоставляется лечение:\r\nпонедельник — пятница с 7.00 — 19.00,\r\nсуббота: 7.00 — 12.00,\r\nвыходной - воскресенье.\r\n\r\nКурс лечения содержит диетическое и диабетическое питание, которое можно заказать в ресторане санатория.\r\nЗавтрак: 7.30 — 10.00\r\nОбед: 11.30 — 14.00\r\nУжин:18.00 — 19.30', '', '', NULL, NULL, NULL, NULL, 3, 1, 0, 0),
(8, 10, 'Aura Palace', '', '["3 (1).jpg","3 (2).jpg","3 (3).jpg","3 (4).jpg","3 (5).jpg"]', 'В центре Карловых Вар, сразу за католическим собором Марии Магдалины, в 100 метрах от Главного источника «Вржидло» находится отель АУРА ПАЛАС 4*.\r\n\r\nЭтот отель был открыт 2004 году, его внешний облик, внутренний интерьер, уровень профессианализма персонала соответствует высоким стандартам качества. Отелю присвоен Международный сертификат качества системы менеджмента (QMS). Отель Аура Палас 4* входит в Ассоциацию отелей и ресторанов Чешской Республики.\r\n\r\nЕсли вы поклонники классики, созерцания красоты, уютной домашней обстановки и прекрасного настроения, то этот отель — ваш выбор.', 'На двух верхних этажах отеля находится бальнеологический центр санатория, где предоставляется комплексная программа классического карловарского лечения: ванны термальные — углекислые, бисерные, водолечение, шотландские брызги, подводные массажи, физиотерапевтические процедуры, лазеротерапия, магнитотерапия,  пневмоакупунктура, массажи, ингаляции, промывание, лечебная физкультура.  ', '', 'Отдыхающим предлагается 54 номера: 10 одноместных, 29 двухместных, 4 трёхместных и одиннадцать апартаментов.\r\n\r\nВсе номера соответствуют категории DELUXE - спутниковое ТВ с российскими программами, телефон, подключение к интернету, сейф, мини-бар, ванная комната, фен, халаты, тапочки.\r\n\r\nРесторан Аура Палас располагается на двух этажах отеля, включая отдельный салон для проведения мероприятий.\r\n\r\nВинный погребок « У крестоносцев» предлагает большой выбор национальных чешских блюд, разливное пиво, маравские вина и многое другое. Открыт с 11.00 до 23.00.\r\n\r\nБлюда на любой вкус чешской и международной кухни предлагаются в форме шведского стола на завтрак с 7.00 — 10.00, в форме меню на обед с 12.00 — 14.30 и ужин с 18.00 — 20.00.\r\n\r\nДиетпитание входит в меню ресторана, назначается лечащим врачом. В летний курортный сезон работает открытая веранда на свежем воздухе со всеми услугами ресторана.', '', '', NULL, NULL, NULL, NULL, 4, 1, 0, 0),
(10, 10, 'Санаторий Bristol Palace', '', '["4 (1).jpg","4 (2).jpg","4 (3).jpg","4 (4).jpg","4 (5).jpg"]', 'Санаторий Bristol Palace - одно из самых красивых зданий Карловых Вар, стиль модерн, XIX век. Санаторий входит в АО «Бристоль Групп». Комплекс состоит из 6 санаториев, связанных между собой подземными закрытыми переходами, обеспечивающими доступ отдыхающих ко всем услугам отелей «Бристоль». Отель знаменит тем, что здесь останавливалось множество именитых гостей, таких, как королева Елизавета, Великий Князь Михаил Александорович и Княгиня Ольга Александоровна, принц Бурбонский, Алексей Косыгин, патриарх Пимен, Зигмунд Фрейд.\r\n\r\nСанаторий Bristol Palace расположен в собственном  английском парке, над Мельничной колоннадой в курортной зоне Карловых Вар.', 'В санатории 49 номеров: 28 одноместных и двухместных, 5 двухместных DE LUXE, 4 двух- местных с балконом, 5 апартаментов, 2 апартамета EXLUSIVE, 3 апартамента DE LUXE, 2 апартамента PREZIDENT.\r\n\r\nОснащение номеров: ванная комната, туалет, спутниковое ТВ с российскими программами, телефон прямой связи, радио, сейф, мини-бар, халаты, тапочки, возможность доп. кровати.\r\n\r\nЕжедневно — уборка номера.\r\nСмена белья: раз в три дня.\r\nСмена полотенец: ежедневно.\r\n\r\nCheck-in: в 14.00\r\nCheck-out: в 12.00\r\nLate Check-out: 30 евро за номер.', 'Вы платите по прибытии в Санаторий Bristol Palace.\r\n\r\nСанаторий Bristol Palace не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Bristol Palace принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express', ' В санатории предоставляется курортное лечение в комплексе — собственный бальнеологический центр с природным минеральным источником, вода из которого используется для лечебных процедур. В каждом санатории — кабинет врача, который дежурит с медсестрой круглосуточно.\r\n\r\nЛечение предоставляется:\r\nПонедельник — пятница: 7.30 — 15.00\r\nСуббота: 8.00 — 12.00\r\nВоскресенье: выходной.\r\n\r\nПредлагаемые процедуры:\r\nВодолечение,  подводные массажи, контрастный душ, гидроксер, грязевые компрессы, пелоидные компрессы, торфяные ванны, парафанго, парафиновое обертывание, криотерапия, классический и рефлексный массажи, ванны из горячих источников ( углекислые, джакузи, с добавками, с противотоком и др.), лечебная физкультура групповая, в бассейне, электротерапия — соллюкс, диатермия, гальванические ванны четырехкамерные, кварцевые лампы, эндо-вако, ультразвук, магнитотерапия, вазотрен, диодинамик, приборный лимфодренаж, тракции, зубные ирригации, ингаляции, газовые уколы, пневмоакупунктура.\r\n\r\nК услугам отдыхающих: небольшой бассейн с минеральной водой 6м х 4м непосредственно в отеле, бассейн неправильной формы 21 м х 8 м — в здании Bristol Palace. Две сауны, на 4 человека каждая. Во внепроцедурное время — 4 евро в час, фитнесс центр, турецкая баня, солярий — 0,6 евро в мин.\r\n\r\nПитание: ресторан находится на 5 этаже отеля на 160 мест. В ресторане отеля Bristol Palace есть еще один ресторан на 140 мест, в котором два салона — Мозер Холл и клуб Холл. Кафе в отеле предлагает отдыхающим большой выбор сладких блюд, коктейлей и танцевальные вечера. Есть диетпитание. Для отдыхающих устраиваются Гарден- пати — пикник с мясом и рыбой, приготовленной на гриле.\r\n\r\nДополнительные услуги: салон хрусталя «Мозер», медицинский диагностический центр «Акрополис», лазерный центр «Асклепион», кинозал, боулинг, бильярд, салон красоты ( со всем набором услуг ).\r\n', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(11, 10, 'Санаторий Bristol Georgy House', '', '["5 (1).jpg","5 (2).jpg","5 (3).jpg","5 (4).jpg","5 (5).jpg"]', 'Санаторий расположен в собственном английском парке над Мельничной колоннадой в курортной зоне Карловых Вар.\r\n\r\nЯвляет собой новое здание комплекса АО «Бристоль Групп», открытый в апреле 2008 года. Архитекторам удалось органично вписать его в атмосферу старинного комплекса внутри английского парка. Со зданием бассейна он окаймляет парк, создавая новую живописную панораму.\r\n', 'Санаторий Bristol Georgy House  -  24 номера, из них два одноместных, 21 двухместный и один апартамент.\r\nОснащение номера: ванная комната с душевой кабиной, туалет, спутниковое ТВ с российскими программами, радио, телефон, мини-бар, сейф, халаты, тапочки.\r\n\r\nУборка номера — ежедневно.\r\nСмена белья: раз в три дня.\r\nСмена полотенец: ежедневно.\r\n\r\nCheck-in: в14.00\r\nCheck-out: в 12.00\r\nLate Check-out: 30 евро за номер.', 'Вы платите по прибытии в Санаторий Bristol Georgy House.\r\n\r\nСанаторий Bristol Georgy House не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Bristol Georgy House принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express', 'В санатории предоставляется курортное лечение в комплексе — собственный бальнеологический центр с природным минеральным источником, вода из которого используется для лечебных процедур. В каждом санатории — кабинет врача, который дежурит с медсестрой круглосуточно.\r\nЛечение предоставляется:\r\n\r\nПонедельник — пятница: 7.30 — 15.00\r\nСуббота: 8.00 — 12.00\r\nВоскресенье: выходной.\r\n\r\nПредлагаемые процедуры:\r\nВодолечение,  подводные массажи, контрастный душ, гидроксер, грязевые компрессы, пелоидные компрессы, торфяные ванны, парафанго, парафиновое обертывание, криотерапия, классический и рефлексный массажи, ванны из горячих источников ( углекислые, джакузи, с добавками, с противотоком и др.), лечебная физкультура групповая, в бассейне, электротерапия — соллюкс, диатермия, гальванические ванны четырехкамерные, кварцевые лампы, эндо-вако, ультразвук, магнитотерапия, вазотрен, диодинамик, приборный лимфодренаж, тракции, зубные ирригации, ингаляции, газовые уколы, пневмоакупунктура.\r\n К услугам отдыхающих: небольшой бассейн с минеральной водой 6м х 4м непосредственно в отеле, бассейн неправильной формы 21м х 8м — в здании БРИСТОЛЬ ПАЛАС. Две сауны, на 4 человека каждая. Во внепроцедурное время — 4 евро в час, фитнесс центр, турецкая баня, солярий — 0,6 евро в мин.\r\n\r\nПитание: ресторан находится на 5 этаже отеля на 160 мест. В ресторане отеля БРИСТОЛЬ ПАЛАС есть еще один ресторан на 140 мест, в котором два салона — Мозер Холл и клуб Холл. Кафе в отеле БРИСТОЛЬ ПАЛАС предлагает отдыхающим большой выбор сладких блюд, коктейлей и танцевальные вечера. Есть диетпитание. Для отдыхающих устраиваются Гарден- пати — пикник с мясом и рыбой, приготовленной на гриле.\r\n\r\nДополнительные услуги: салон хрусталя «Мозер», медицинский диагностический центр «Акрополис», лазерный центр «Асклепион», кинозал, боулинг, бильярд, салон красоты ( со всем набором услуг ).\r\n     \r\n', '', '', NULL, NULL, NULL, NULL, 4, 1, 0, 0),
(12, 10, 'Санаторий Imperial', '', '["6 (1).jpg","6 (2).jpg","6 (3).jpg","6 (4).jpg","6 (5).jpg"]', 'Карловы Вары — знаменитейший курорт Чехии. Здесь туризм неразрывно связан с лечением. Без малого 650 лет служат местные термальные источники для приезжающих сюда полечиться и отдохнуть.\r\nИ еще одна фишка Карловых Вар —  ежегодное проведение Международного кинофестиваля.\r\n\r\nОтель « Imperial » - важный карловарский памятник архитектуры, построенный в начале ХХ века. С первого дня он стал очень популярным, относясь к разряду самых лучших отелей класса «Люкс».\r\n\r\nОтель Imperial был построен в период с 1910 по 1912 гг. французским архитектором Эбраром, стиль — неоклассицизм, выглядит как великолепный старинный дворец.\r\nЭтот отель - один из трех санаториев АО « Imperial », сюда входит отель «Швейцарский двор», «Сан-Суси».\r\n\r\nСанаторный комплекс состоит из главного корпуса курортного отеля и Виллы Гофман 3*.\r\n\r\nОтель расположен на холме, с открывающейся панорамой города с одной стороны, с другой — панорама холмистых гор до самого горизонта.\r\n\r\nСвязь с источниками — при помощи фуникулера, для гостей санатория проезд бесплатный.\r\nПитевое лечение в самом санатории находится на первом этаже в питьевой галерее, туда проведена вода от Главного минерального источника — ВРЖИДЛО.\r\n', 'Санаторий располагает 219 номерами: 33 одноместных номера, 169 двухместных номеров, 15 апартаментов, 1 Президентский Апартамент, 1 апартамент Дипломат.\r\n\r\nОснащение номеров: ванная комната, туалет, телефон, сейф, мини-бар, спутниковое ТВ с российскими программами, фен, халат, тапочки в апартаментах, в остальные номера можно заказать за дополнительную плату, возможно подключение интернет.\r\n\r\nЕжедневная уборка номера.\r\nСмена белья: 2-3 раза в неделю.\r\nСмена полотенец: ежедневно.\r\n\r\nCheck-in: в14.00\r\nCheck-out: в 12.00\r\nLate Chek-out: до 18.00 — оплата 50% стоимости номера', 'Вы платите по прибытии в Санаторий Imperial.\r\n\r\nСанаторий Imperial не требует для осуществления бронирования предоставлять данные о вашей банковской карте.\r\n\r\nСанаторий Imperial принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Санаторий предоставляет курортное лечение со специализацией в комплексе: гастроэнторологические заболевания, нарушение обмена веществ, болезни опорно -двигательного аппарата. Собственный бальнеологический комплекс с суперсовременным оборудованием предоставляет до 850 процедур в сутки. Вода горячих целебных источников используется и для процедур. В санатории работают гематологическая и биохимическая лаборатории. Здесь же проводятся все виды массажа, кишечные промывания, ванны, парафин, парафанго, грязевые компрессы, ингаляции, кислородная терапия, магнитная терапия, лечебный лазер, пневмоиглоукалывание, диатермия, нагревательная паровая баня «оккайдо», лечение для укрепления сосудов у диабетиков, нагрузочная эргометрия в целях диагностики. В санатории имеется спортивный зал, сауна, крытый бассейн.\r\n\r\nЛечение предоставляется:\r\nпонедельник -  пятница: с 7.00 до 15.00\r\nсуббота: с 7.00 до 12.00\r\nвоскресенье: выходной.\r\n\r\nК услугам гостей: закрытый бассейн ( 15м х на 8 м) — с 8.00 до 15.00 для процедур, с 18.30 до 21.30 бесплатно, солярий, сауна, тренажёрный зал, крытые и открытые теннисные корты.\r\n\r\nКурортный ресторан «Прага» на 350 посадочных мест ( завтрак и ужин — шведский стол, обед — выбор меню, кто отдыхает в апартаментах, тоже питается в ресторане «Париж». Венское кафе с летней террасой, винный бар, ночной клуб, кинозал и концертный зал.\r\nДополнительные услуги: косметический салон, парикмахерская, торговый центр, прачечная, охраняемая стоянка автомобилей, интернет-клуб, конференц- зал, фуникулер  для постояльцев бесплатно.\r\n\r\nРасписание работы фуникулера:\r\nПонедельник — пятница: с 5. 45 до 21.00\r\nСуббота — с 7.00 до 21.10\r\nВоскресенье — с 7.55 до 21.10\r\nИнтенсивность движения — каждые 15 минут.\r\n', '', '', NULL, NULL, NULL, NULL, 4, 1, 0, 0),
(13, 10, 'CARLSBAD PLAZA Medical Spa & Wellness hotel ', '', '["7 (1).jpg","7 (2).jpg","7 (3).jpg","7 (4).jpg","7 (5).jpg"]', 'КАРЛСБАД ПЛАЗА 5*  - один из лучших в Карловых Варах по ассортименту и качеству услуг, предоставляемых отдыхающим. Санаторий был открыт в декабре 2005 года в результате полной реконструкции исторического объекта ( Рудольфсхофа). Фасад здания остался неизменным, но внутри  - это суперсовременный отель международного класса. Первого апреля 2007 года КАРЛСБАД ПЛАЗА 5* был принят в члены престижного альянса «The  Leading Hotels of the World”. КАРЛСБАД ПЛАЗА 5* - первый отель Карловых Вар, который удостоился такой высокой оценки. Альянс «The Leading Hotels of the World” объединяет 440 самых высококлассных отелей мира. КАРЛСБАД ПЛАЗА — в одном ряду с такими отелями как RITZ в Париже, Лондоне или Мадриде, отелями  PLAZA ATHENEE в Нью- Йорке, RAFFLES  PALACE в Монтрё,  MAJESTIK в Риме или Каннах.  \r\n\r\nСанаторий расположен в тихой части курортной зоны напротив парка на берегу реки Тепла.\r\n', 'Санаторий состоит из двух зданий — нового и старого, несущего на себе память времени, в отеле 160 номеров категории «Luxuru” .\r\nНовое Здание ( New House) - название новой части отеля, которую пристроили в ходе реконструкции к историческому зданию. Сочетание современной архитектуры и классической роскоши прекрасно дополняют друг друга, образуя единое целое — КАРЛСБАД ПЛАЗА. В новой части отеля 91 номер класса Люкс. Номера расположены на 4 — 8 этажах, сообщение со старым зданием (Old House) осуществляется с помощью прохода на 4 этаже.\r\n\r\nСтарое Здание (Olf House) - историческая часть отеля, возникшая в результате полной реконструкции. Все строительные и реставрационные работы проходили при строгом контроле управления по охране памятников, истории и культуры, благодаря этому фасад здания сохранил свой первозданный вид. В Старом Здании отеля  - 69 номеров класса Экстра-Люкс ( 2 — 5 этажи), здесь проходит вся общественная жизнь отеля — бары, рестораны, конференц-залы. Во всех номерах есть ванная комната, туалет, в старом здании биде, телефон, холодильник, мини-бар, будильник, спутниковое ТВ с российскими программами, выход в интернет, сейф, фен, халаты, тапочки. Центральное кондиционирование воздуха во всех номерах. Окна Нового здания выходят на просторный двор солнечной террасы. Ежедневно уборка номера, смена белья, смена полотенец.\r\n\r\nCheck-in: 14.00\r\nCheck-out: 12.00\r\nLate Check-out: до 18.00 — оплата 50 % стоимости номера.\r\n', 'Вы платите по прибытии в CARLSBAD PLAZA Medical Spa & Wellness hotel.\r\n\r\nCARLSBAD PLAZA Medical Spa & Wellness hotel осуществляет временное блокирование 100% стоимости заказа на вашей банковской карте за 7 дней до заезда. Сумма физически не снимается с карты, а только временно блокируется на случай, если вами будет произведена отмена бронирования уже в период действия штрафных санкций.\r\n\r\nCARLSBAD PLAZA Medical Spa & Wellness hotel принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'К слугам гостей  Wellnessland  -  SPA-комплекс, расположенный на территории 600 кв.м., не имеющий аналогов в Карловых Варах. Wellnessland  включает в себя 5 бассейнов, 7 видов саун — финская, ароматическая, соляная, русская баня, турецкая баня. Stillhoff -  комната отдыха с подогреваемыми шезлонгами, Relaxgasse с классическим и нетрадиционным массажем и ванной «Caracalla” (более 150 массажных струй), фитнес-бар Kaizerhof , солярий.\r\n\r\nВ отеле три ресторана и три бара. Французский ресторан «La Bohema”встретит вас богатым интерьером. Вы попробуете изысканные блюда французской кухни, закажете себе чашечку кофе или чая. Ресторан «Sorrento” буден рад видеть вас в течение всего дня. Здесь можно провести время с друзьями. Любитель восточной кухни непременно попробует суши и Кунг-Пао в ресторане  «Sweet orient” . Восточный интерьер ресторана запомнится вам надолго.\r\n\r\nРесторан  «Bon soir cafe” предлагает лёгкие закуски, ароматный кофе, отдых с друзьями. Здесь представлено внушительное количество сортов кофе и вы сможете заказать себе чашечку кофе на свой вкус.\r\n', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0),
(14, 10, 'Санаторий Kolonada', '', '["8 (1).jpg","8 (3).jpg","8 (4).jpg","8 (5).jpg"]', 'Санаторий КОЛОНАДА 4*  возник после полной реконструкции соединенных между собой курортных домов в 1997 году. Впервые отель упоминается в 1802 году под названием «Золотой Лев», впоследствии переименованный в отель «У Вильгельма Прусского». Среди знаменитых отдыхающих были принц Людовик Бонапарт и Н.В. Гоголь. В наши дни отель КОЛОНАДА 4* представляет собой современный курортный комплекс, оснащенный первоклассным оборудованием.\r\n\r\nСанаторий находится на набережной реки  Тепла вблизи от минеральных источников, что делает КОЛОНАДУ одним из привлекательных курортов Карловых Вар.\r\n', 'Санаторий располагает 147 номерами — 46 одноместных, 86 двухместных, 15 апартаментов.\r\nВ 61 номере возможно размещение на раздельных кроватях -  TWIN bed.  Все номера оснащены оборудованием — фен, телевизор, мини-бар, сейф. Уборка номеров ежедневно, смена полотенец и белья два раза в неделю, есть возможность доп. кровати.\r\n\r\nCheck-in: 14.00\r\nCheck-out: 12.00\r\nLate Check-out: 30 евро\r\n', 'Вы платите по прибытии в Санаторий Kolonada.Санаторий Kolonada не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении.\r\n\r\nИнформация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты\r\n\r\nСанаторий Kolonada принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express', 'Санаторий КОЛОНАДА предоставляет отдыхающим большой спектр услуг:  кафе — ресторан Патрия, где можно провести незабываемый вечер. К их услугам парикмахерская, косметический салон, солярий, финская баня, бассейн неправильной формы с противотоком воды ( длина 7 м., общая пл. 30 кв.м.).  Информационный центр находится на первом этаже отеля, где можно заказать различные экскурсии, получить информацию о культурных и спортивных мероприятиях.\r\nЗавтраки, обеды и ужины — в ресторане санатория, также можно заказать диетическое и вегетарианское питание.\r\n\r\nЗавтрак: 7.00 — 10.00, шведский стол, напитки в цене.\r\nОбед: 12.00 — 14.30, меню из 3 блюд.\r\nУжин: 18.00 — 20.00, меню из 3 блюд.\r\n\r\nВсе лечебные процедуры предоставляются в бальнеологическом комплексе санатория.\r\n\r\nЛечение ежедневно:\r\nпонедельник — пятница с 7.00 до 19.00\r\nсуббота — с 7.00 до 19.00\r\nвоскресенье — выходной.\r\n  ', '', '', NULL, NULL, NULL, NULL, 4, 1, 0, 0),
(15, 10, 'Санаторий Krivan', '', '["1 (1).jpg","1 (2).jpg","1 (3).jpg","1 (4).jpg","1 (5).jpg"]', 'Санаторий Кривань расположен в центре курортной зоны Карловых Вар, рядом с минеральными источниками: Садовая колоннада и Млынская колоннада.\r\nСанаторий «Кривань» расположен в самом центре курортной зоны Карловых Вар, прямо напротив Садовой колоннады с питьевыми термальными минеральными источниками. В санатории «Кривань» новый лечебный центр, и бассейн с 40% термальной водой.\r\n\r\nВсе лечебно-оздоровительные процедуры проводятся в лечебном центре расположенном прямо в здании санатория.\r\n\r\n«Krivan» относится к числу санаториев Карловых Вар с наиболее качественной лечебной базой и широким спектром предлагаемых процедур. Оптимально подходит людям, имеющим проблемы не только с желудочно-кишечным трактом, но и с опорно-двигательным аппаратом. Отличительной особенностью лечебной базы санатория является наличие процедуры «флоутинг», которая проводится на основе воды с солями Мертвого моря, что оказывает одновременно лечебный и релаксирующий эффект. Санаторий «Кривань» также имеет собственную соляную пещеру, что оптимально подойдет гостям, имеющим кроме проблем ЖКТ, сопутствующие заболевания органов дыхания.', 'Санаторий Кривань со своими корпусами «Конкордия», «Колумбус», «Слован» имеет 141 одноместных, один двухместный номер, несколько апартаментов. Все номера имееют ванные комнаты, туалет, телефон, спутниковое ТВ с российскими программами.', 'Вы платите по прибытии в Санаторий Krivan.\r\n\r\nСанаторий Krivan не требует для осуществления бронирования предоставлять данные о вашей банковской карте.\r\n\r\nСанаторий Krivan принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Отель располагает: ресторан, кафе, летняя терраса с музыкой и танцами, парикмахерская и салон красоты.\r\n\r\nЛечение: проводится в бальнеологическом отделении санатория, с использованием минеральной воды. Комплекс процедур проходит под наблюдением опытных курортных врачей, предлагающих лечебно-оздоровительные программы: комплексное курортное лечение, редукционная программа ( для похудения), оздоровительная программа для пожилых людей, косметическая ( регенерационная — омолаживающая) программа, противострессовая программа, оздоровительная программа для детей до 12 лет — сокращенное лечение (7) дней, оздоровительная программа для детей старше 12 лет, индивидуальная реабилитационная программа (для страдающих заболеваниями опорно -двигательного аппарата). Общеукрепляющая программа.\r\n\r\nМедицинское обслуживание обеспечивается высококвалифицированными сотрудниками. Лечение проходит в собственном бальнеоцентре: шотландский душ, газовые углекислые ванны, бассейн с противотоком, сауна, процедуры в гидропунктурной ванне, оксигенотерапия, иглотерапия классическая, пневмо-, электро -, соно- и лазерная терапия, криотерапия, магнитотерапия, промывание кишечника, комплексное электролечение. Все виды гимнастики можно проводить в собственном фитнес-центре. Для релаксации и понижения хронических видов болезни кожи служит Флеутинг (эффект Мертвого моря).\r\n\r\n Показания к курортному лечению.\r\n\r\nЗаболевания желудочно-кишечного тракта: желудка и двенадцатиперстной кишки, желчного пузыря и желчных протоков, печени и поджелудочной железы, нарушение обмена веществ: ожирение, подагра, сахарный диабет, нарушение липидного обмена, заболевание опорно-двигательного аппарата и центральной нервной системы: полирадикулит, полиневропатия разной этиологии, дегенеративные заболевания центральной и периферийной нервной системы, состояние после операции на суставах, больших суставах и позвоночном столбе, дегенеративные заболевания суставов и позвоночного столба, функциональные нарушения двигательного сегмента.', '', '', NULL, NULL, NULL, NULL, 3, 1, 0, 0),
(16, 11, 'Санаторий Cristal Palace', '', '["1 (1).jpg","1 (2).jpg","1 (3).jpg","1 (4).jpg","1 (5).jpg"]', 'Отель Кристалл Палас открыт в 1996 году, специализируется на лечении, курортных, оздоровительных, релаксационных, горнолыжных и гольфовых путевках, расположен в центре курортного города Марианские Лазни.\r\n\r\nКоличество номеров в отеле: 93 номера, рассчитанных на 186 мест.\r\n', 'Прямой телефон, спутниковое ТВ с российскими программами, радио, сейф, мини-бар, ванная комната с феном, утюг и гладильная доска, пожарная сигнализация, система автоматического пожаротушения.\r\n\r\nИнфраструктура отеля: reception, парковка автомобилей на 45 мест, интернет, услуги прачечной и химчистки, конференц-зал, оборудованный современной аудио-визуальной аппаратурой, обслуживание в номерах.\r\n\r\nПлатный сервис: прокат ноутбуков.\r\n', 'Вы платите по прибытии в Санаторий Cristal Palace.\r\n\r\nСанаторий Cristal Palace не требует для осуществления бронирования предоставлять данные о вашей банковской карте.\r\n\r\nСанаторий Cristal Palace принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB', 'Релаксационный центр с услугами физиотерапии, бальнеологии, лечебной реабилитации, проходящие под наблюдением медперсонала, бассейн, сауна, солярий, вирпул.\r\n\r\nРесторан отеля рассчитан на 70 мест, предлагает посетителям широкий выбор блюд чешской и международной кухни, с дополнением изысканных моравских и зарубежных вин, кафе на 76 мест с открытой террасой на 36 мест порадует любителей сладкого широким ассортиментом кофе, тортов, пирожными собственного приготовления, изысканными десертами и мороженым.\r\n\r\nДополнительная информация: разрешено содержание домашних животных.', '', '', NULL, NULL, NULL, NULL, NULL, 0, 0, 0),
(17, 11, 'Санаторий Nove Lazne', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'В центре курорта Марианские Лазни находится санаторий.\r\n\r\nНОВЫЕ ЛАЗНИ 5* Величественная архитектура здания поражает воображение — один из самых красивых и лучших санаториев был построен в 1896 году. В начале XIX столетия основатель города аббат Карел Кашпар Рейтенбергер построил здесь один из первых курортных домов, но тогда здание смотрелось по- иному. Большая реконструкция отеля была проведена в конце XIX века по причине частых визитов английского короля Эдуарда VII. Санаторий Новые Лазни сохранил свои исторические интерьеры: Римские бани, Королевскую кабину Эдуарда VII и Императорскую кабину астрийского монарха Франца Иосифа II Габсбургского.', '', 'Вы платите по прибытии в Санаторий Nove Lazne.\r\n\r\nСанаторий Nove Lazne не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. \r\n\r\nИнформация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. \r\n\r\nВ этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Nove Lazne принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Обширное лечебное отделение предоставляет комплексное курортное лечение высокого уровня, лабораторные анализы, лечебные процедуры на базе природных лечебных средств — грязевые конверты, сухие углекислые ванны, газовые инъекции, минеральные ванны, водолечение в комплексе Римских бань.\r\n\r\nЛечение предоставляется:\r\nПонедельник — суббота. С 7.00 -15.30\r\nВоскресенье — закрыто.\r\n\r\nМинимальный срок пребывания для заказа классического пакета лечения — 7 ночей.\r\nВ классический пакет лечения включено:\r\nосмотр врачом в начале и в конце лечения, контрольные осмотры по назначению врача, лабораторные анализы, 24 лечебные процедуры в неделю согласно предписания врача, питьевой курс, круглосуточный врачебный контроль, круглосуточный уход медсестры.\r\n\r\nДети принимаются с 4 лет:\r\nпрофилактическая лечебная программа ( с 4 до 6 лет), классическая лечебная программа (с 6 до 12 лет), профилактическая лечебная программа ( с 7 до 12 лет).\r\n\r\nОздоровление и красота\r\n\r\nРимские бани с 3 бассейнами, вирпул, сауна, парная, санарий.\r\nВ курортном комплексе: фитнес-центр  Emporium beauty.\r\nЗа оплату: ванны, массажи, криосауна, солярий, косметический салон, лазерный центр, парикмахерская.  \r\n            \r\n', '', '', NULL, NULL, NULL, NULL, 5, 1, 0, 0),
(18, 10, 'Спа отель Olympia', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg","1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'На театральной площади Карловых Вар недалеко от знаменитого источника Гейзер находится санаторий ОЛИМПИЯ.\r\n\r\nЗдание санатория было построено в начале ХХ  века, стиль модерн, относящийся к архитектурным историческим памятникам Чешской Республики, находится под охраной государства. Санаторий славится комфортом, качественным обслуживанием, расположению в центре города — Вы не ошибетесь с выбором санатория ОЛИМПИЯ.\r\n\r\nВржидельная колоннада с Главным источником всего в 100 метрах от санатория.\r\n', 'Санаторий ОЛИМПИЯ - как раз для отдыхающих, ищущих уединения, когда не мешает суета и городской шум. В санатории 37 номеров: 9 номеров с видом Атриум ( внутренний двор отеля), 24 номера — вид на парк и театральную площадь, 4 апартамента. В каждом номере возможно (single use) одноместное проживание.\r\n\r\nВ номерах все удобства: ванная комната, туалет, фен, мини-бар, спутниковое ТВ с российскими программами, радио, сейф, халаты, тапочки, кондиционер воздуха. Есть номера для курящих, возможность доп. кровати, детской кроватки. Есть интернет.\r\nУборка номера ежедневно. Смена белья: два - три раза в неделю, смена полотенец — ежедневно.\r\n\r\nCheck-in: 14.00\r\nCheck-out:12.00\r\nLate check-out: до 18.00 - оплата 50% стоимости номера.\r\n', 'Вы платите по прибытии в Спа отель Olympia.\r\n\r\nСпа отель Olympia не требует для осуществления бронирования предоставлять данные о вашей банковской карте.\r\n\r\nСпа отель Olympia принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express', 'Санаторий ОЛИМПИЯ 4* предоставляет комплексное курортное лечение в собственном бальнеоцентре: 18 процедур в неделю, три вида медицинского контроля: первичный — после приезда и размещения в санатории, дежурный врач назначает индивидуальный курс процедур с индивидуальной диетой, при необходимости — лабораторные исследования. Контрольный осмотр по назначению врача, заключительный медосмотр — по итогам лечения.\r\nПрием детей на лечение - с 15 лет.\r\n\r\nЛечение:\r\n\r\nпонедельник — пятница с 7.00 до 19.00,\r\nсуббота с 7.00 до 19.00,\r\nвоскресенье - выходной.\r\n\r\nК услугам отдыхающих  - джакузи, сауна на 6 человек, фитнес, бассейн ( 14м. х 5 м.), ресторан на 70 мест (с 7.00 до 23.00), лобби-бар (с 10.00 до 22. 00).\r\n\r\nПитаются отдыхающие в ресторане отеля.\r\nЗавтрак : 7.00 — 10.00, шведский стол.\r\nОбед: 12.00 — 14.00 по меню, выбор из 12 блюд.\r\nУжин: 17.00 — 19.00 по меню, выбор из 12 блюд.\r\n\r\nСпециалисты санатория применяют некоторые виды диет в зависимости от состояния пациента: диабетическая, диета с низким содержание соли, основная рациональная, диета для редукции веса; при заболеваниях поджелудочной железы, диета с низким содержанием пуринов;  с низким содержанием жиров, вегетарианское питание.                      \r\n\r\n \r\n', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(19, 10, 'Санаторий Richmond', '', '["1.jpg","2.jpg","3.jpg","4.jpg"]', 'На берегу живописной реки Тепла, в прекрасном английском парке, в самой тихой части Карловых Вар расположился санаторий РИЧМОНД, традициям курортного лечения которого уже более 160 лет. Санаторий построен в стиле неоклассицизма, в нем в 30 годах 19 столетия было курортное кафе «Шёнбрунн».\r\n\r\nКурортные леса и прекрасный парк, окружающие санаторий, дают отдыхающим уникальные возможности для прогулок, которые просто необходимы отдыхающим в качестве составляющей санаторно-курортного лечения. В санатории поддерживается по-домашнему семейная обстановка, создающая приятную атмосферу для отдыха.\r\n\r\nКоллонады с минеральными источниками находятся в 15 минутах ходьбы от санатория. Можно прогуляться по тропе Гете вдоль реки Тепла, а можно с помощью городского транспорта, остановка автобуса -  напротив санатория. Интервал движения — каждые 15 минут. Для отдыхающих санатория проезд по курортной карте бесплатно.\r\n', 'Санаторий Ричмонд располагает 116 номерами: 22 одноместных номера, 87 двухместных и 8 апартаментов. Номера оснащены ванной комнатой или душем, туалетом, спутниковое ТВ с российскими программами, телефон, фен, сейф, мини-бар. Ежедневно уборка номера, смена белья 3 раза в неделю, смена полотенец — ежедневно. Подключение к интернету. \r\n\r\nЕсть отдельные номера для курящих людей.За дополнительную плату возможно проживание с домашними животными.\r\n\r\nCheck-in: 14.00.\r\nCheck-out:в 12.00\r\nLate check-out: до 18.00 — оплата 50% стоимости номера.\r\n', 'Санаторий Richmond взимает 30% стоимости заказа с вашей банковской карты за 15 дней до заезда.\r\n\r\nСанаторий Richmond принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB', 'У санатория собственный бальнеологический центр, где отдыхающие ежедневно получают лечебные процедуры, кроме воскресенья, с 7.00 до 15.30. Лечение детей с 15 лет. Бассейн ( 6 х на 12,5 м), открыт ежедневно с 8.00 до 12.00 и с 14.00 до 21.00. Сауна на 4 персоны.\r\n\r\nРесторан санатория — на 120 мест. Возможно диетическое и вегетарианское питание. Кафе с летней террасой на 40 мест, летний ресторан на 60 мест.\r\n\r\nК услугам отдыхающих парикмахерская с маникюрным и педикюрным кабинетами. К услугам наших клиентов охраняемая автостоянка. Кто любит порыбачить — пожалуйста! Есть такая возможность!\r\n\r\nОтветственный персонал отеля организует различные экскурсии по окрестностям: знаменитая фабрика по производству стекла «Мозер», средневековый город ЛОКЕТ, древние замки и монастыри, а также в городском театре  можно посмотреть спектакли или послушать Карловарский симфонический оркестр.  \r\n       \r\n', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(20, 10, 'Санаторий Savoy Westend', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'SAVOY WESTEND 5* - элитный санаторий,  расположен в районе ВЕСТЕНД — престижной части Карловых Вар.\r\n\r\nНаходясь среди элегантных вилл и английских парков, САВОЙ отличают умиротворенность, чистый горный воздух и прекрасные панорамы на город.\r\n\r\nОтель построен в период с 1895 — 1896 гг., стиль — классицизм, автор — известный венский архитектор Альфред Байер.\r\n\r\n  \r\nСАВОЙ ВЕСТЕНД превратился в современнейший отель высокого международного уровня, состоящий из пяти вилл, из которых каждая имеет свое название: Русалка, Клеопатра, Артемис, Савой, Карлтон. Все корпуса, кроме Клеопатры, и Spa - центр Афродита, между собой соединены подземными переходами и лифтами.\r\n', 'Санаторий находится в центральной части Карловых Вар, рядом с консульством России, недалеко расположен Православный храм Петра и Павла.Продуманная система лифтов и переходов сокращает прогулку к источникам до пяти минут, выход — на Садовую улицу.\r\n\r\nСанаторий  имеет в наличии 128 номеров, отличающиеся роскошью и богатством, со стильной мебелью и безукоризненным декором.\r\n\r\nВилла Савой: Superior -9, Superior Plus -23, Savoy Suite-1,Prezidential Suite-1\r\n\r\nВилла Артемис:Superior – 2, Apartment -4\r\n\r\nВилла Клеопатра: Economy -3, Standart -1, Comfort – 10, Superior Plus – 17\r\n\r\nВилла Карлтон: Econovy -2, Standart – 1, Comfort -1, Superior – 16, Junuor Suite-4,  Suite-2\r\n\r\nВилла Русалка:Economy -9, Standart-10.\r\n\r\nВ номерах имеется кондиционер, телефон, спутниковое ТВ, холодильник мини-бар, сейф, фен, утюг, электронный дверной замок.\r\n\r\nCheck-in: в 14.00\r\nCheck-out: в 12.00\r\nLate Check-out:  до 18.00 — оплата 50% стоимости номера.', 'Вы платите по прибытии в Санаторий Savoy Westend.\r\n\r\nСанаторий Savoy Westend осуществляет временное блокирование 50% стоимости заказа на вашей банковской карте за 15 дней до заезда. Сумма физически не снимается с карты, а только временно блокируется на случай, если вами будет произведена отмена бронирования уже в период действия штрафных санкций.\r\n\r\nСанаторий Savoy Westend принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Бальнеоцентр АФРОДИТА расположен на территории пл.3000 кв.м, является одним из самых современных бальнеологических центров в Чешской республике с полным набором медицинских услуг и новейшим оборудованием. Бальнео- центр включает в себя большой плавательный бассейн, парную баню, сауну, вихревую ванну Whirlpool, дорожку по методу доктора Кпайппа и фитнес- зал — для гостей отеля бесплатно.\r\n\r\nВ отеле два ресторана: САВОЙ и САВОЙ РОЯЛЬ, кафе-бар KING*s CLUB, каждый день с 18.00 живая музыка, боулинг- центр с четырьмя дорожками, дартс, бильярд.\r\n\r\nРесторан САВОЙ — с великолепным видом из окон. Завтрак — шведский стол с богатым выбором блюд. Обед и ужин сервируются. Есть диетическое питание, а также возможность отметить торжественное событие с предложением особого меню.\r\nРесторан САВОЙ РОЯЛЬ — французский ресторан для гурманов. Шикарный интерьер,  огромный выбор блюд международной кухни, карта вин со всего мира.\r\n', '', '', NULL, NULL, NULL, NULL, 5, 1, 0, 0),
(21, 11, 'Санаторий Centralni Lazne', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Санаторий ЦЕНТРАЛЬНЫЕ ЛАЗНИ был построен у Мариинского источника в начале 19 века и назывался в то время «Старые Лазни». Сооружение многократно перестраивалось и расширялось. Сегодняшний вид здание приобрело после полной реконструкции архитектором И.Шаффером  в 1889 -1892 гг. Строительство велось на средства Тепельского монастыря, которому принадлежало здание. Об этом напоминает герб на фасаде здания.\r\n\r\nНа территории санатория находится «городской клад — источник Марии», его состав отвечает 100% природного углекислого газа. Здесь впервые для лечения начали применять паровые и газовые ванны, грязевые укутывания.\r\n\r\nСанаторий ЦЕНТРАЛЬНЫЕ ЛАЗНИ расположен в курортной части города вблизи колоннады и парка, у павильона Амброжова источника.\r\n', 'Санаторий соединен переходом с отелем Новые Лазни. Отели имеют общий доступ к просторному СПА-комплексу Roman baths,  предлагающему гостям минеральные ванны, бальнеотерапию, шиацу и др. процедуры для поднятия жизненного тонуса. Для проведения досуга неподалеку находятся гольф-поля, теннисные корты, зимой — катаемся на лыжах.\r\n\r\nВ отеле — 121 номер ( в том числе 13 номеров категории  suite), ресторан (чешская и международная кухня), бар, 4 конференц-зала (до 450 человек), интернет, парковка, услуги няни ( по запросу).\r\n \r\nСПА-комплекс Roman baths : 24 процедурных кабинета, 3 бассейна, гидромассажный бассейн, минеральные ванны, углеродные ванны, сауна, парная, бассейн для процедур по методу Кнайпа, салон красоты, массаж, шиацу, тренажерный зал, пилатес, тай-чи, физиотерапия, гидроколонотерапия, бальнеотерапия, гидротерапия, стоунтерапия, электротерапия, ароматерапия, кислородная терапия, криотерапия, рефлексология, магнитотерапия, акупунктура, ингаляции, обёртывание.\r\n \r\nВ распоряжении гостей санатория и отеля «Гарни Неаполь» два ресторана- «Гете» на 128 мест и «Ульрика» на 88 мест, где предлагается завтрак-буфет, обеды и ужины — по меню. В рационе блюда чешской и международной кухни, диетпитание. Питание — полный пансион.', 'Вы платите по прибытии в Санаторий Centralni Lazne.\r\n\r\nСанаторий Centralni Lazne не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. \r\n\r\nИнформация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании.В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Centralni Lazne принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Услуги: ресторан, кафе, экскурсии, трансферы, парикмахерская, солярий, косметический кабинет, обмен валюты.\r\n\r\nВ санатории есть лечебное отделение: предлагается прием минеральной воды, водолечение, широкий спектр процедур.', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(22, 10, 'Санаторий Čajkovskij ', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Санаторий ЧАЙКОВСКИЙ находится в красивейшем тихом районе Карловых Вар   рядом с православным собором Петра и Павла.\r\n\r\nСанаторий назван именем великого русского композитора, любившего бывать в Карловых Варах.\r\n', 'В санатории 37 номеров: 3 одноместных номера, 28 двухместных номеров ( 9 с балконом) и 6 апартаментов.\r\nОснащение номеров: ванная, туалет, халаты, мини-бар, фен, сейф, телефон, радио, спутниковое ТВ.\r\n\r\nЕжедневная уборка номера, ежедневная смена полотенец.\r\n\r\nCheck in: в 14.00\r\nCheck-out: в 12.00\r\nLate check-out:30% от стоимости номера.\r\n', 'Вы платите по прибытии в Санаторий Čajkovskij.\r\n\r\nСанаторий Čajkovskij не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. \r\n\r\nИнформация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Čajkovskij принимает оплату наличными и банковские карты: VISA, VISA Electron, Mastercard, Maestro, American Express, JCB, DCI', 'Санаторий имеет свой бальнеоцентр,  где осуществляются все лечебные процедуры:\r\nпонедельник — пятница :с 7.30-15.00\r\nсуббота: 8.00 -13.00\r\nвоскресенье: выходной.\r\n\r\nДевятиметровый крытый бассейн с противотоком и сауна — к услугам гостей.\r\nРесторан — международная, чешская кухня и диетпитание.\r\n\r\nПредлагаемые процедуры:\r\n\r\nWhirlpool, аэробика, антицеллюлитная программа, антистресс-программы, акупрессура, аквагимнастика, ванны: ароматическая, минеральная, природная углекислая, травяная, ванна с добавками, ванное обрызгивание, газовые инъекции, гимнастика, галванотерапия, грязевая процедура — оборачивание, компресс, диатермия, диетотерапия, дыхательные упражнения, жемчужная ванна, импульсотерапия, ингаляция, кислородное лечение, косметические процедуры, лечебная физкультура,метод Кнейппа, лимфодренаж, магнитотерапия, массажи всех видов, минеральная питьевая программа, парафиновые процедуры, реабилитационное плавание с упражнениями, самонагревательные грязи, сауна - два вида, фототерапия, шотландский душ, ЭКГ, фитнес-центр.\r\n\r\nДополнительно: амбулаторные услуги, безбарьерный доступ инвалидов, детские курортные программы, курортные программы для матери и ребенка, курортные программы для подростков, постоянная служба медсестры, служба скорой медпомощи.', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0);
INSERT INTO `hotel` (`id`, `townId`, `name`, `video`, `photos`, `expert`, `excellence`, `termsOfPayment`, `services`, `mainReadings`, `secondaryReadings`, `sorting`, `cancelNoPenalty`, `cancel30Penalty`, `cancel100Penalty`, `star`, `top`, `requestCount`, `commentCount`) VALUES
(24, 11, 'Спа отель Labe', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Отель расположен видеальном месте над павильоном Крестового источника и курортной колоннадой, в тихой части курорта. Отдыхающие отеля могут прогуливаться на променаде недалеко от места своего проживания, наслаждаясь созерцанием поющего фонтана.\r\n\r\nСпа отель "Labe" оптимально подойдет гостям курорта, которые хотят проживать максимально близко к минеральным источникам и центру курортной зоны Марианских Лазней. Особенно удобно расположение спа отеля гостям, имеющим проблемы с опорно-двигательным аппаратом, которым тяжело долго ходить.', 'Отель располагает 32 номерами, ресторан «Колоннада» с прекрасным видом на курортную колоннаду.\r\nЛечебные и СПА процедуры: с природным СО2, различные виды массажей, парафиновые компрессы, электротерапия. Отель для некурящих. Подключение к интернету за дополнительную плату.\r\n\r\nНОМЕРА: 32 номера категории Комфорт.\r\nОборудование номеров: душ или ванна, туалет, телевизор, интернет, телефон, сейф, мини -бар.\r\n\r\nРесторан «Колоннада»\r\n\r\nОтдыхающие могут выбрать по вкусу блюда из меню чешской и международной кухни или из широкого ассортимента диетических блюд.\r\nВместимость: 60 мест.\r\nЧасы работы:\r\nЗавтраки: 7.00 — 10.00\r\nОбеды: 11.30 — 14.00\r\nУжины: 17.30 — 20.30\r\nСервировка:\r\nЗавтраки: шведский стол\r\nОбеды и ужины: сервируются, выбор из 5 вторых блюд, салатовый буфет.\r\nДиеты: диабетическая, вегетарианская, низкобелковая, щадящая, для похудания, остальные диеты по желанию.\r\n\r\nЛечение и красота\r\n\r\nВ санатории ЛАБЕ есть лечебное отделение, в котором можно пройти часть процедур — сухие газовые ванны СО2, газовые уколы, ингаляции, парафиновые укутывания, массажи, электротерапия, ультразаук, криотерапия. Другие лечебные процедуры можно пройти в отелях «Звезда» и «Центральные Лазни».\r\n24 часовое дежурство врача.\r\nОсмотры врача: в отеле «Звезда» по предварительной договорённости.\r\nПроцедуры:\r\nПонедельник — пятница: 7.00 — 15.00\r\nПриглашаем Вас провести сказочный отпуск на нашем курорте.', 'Вы платите по прибытии в Спа отель Labe.\r\n\r\nСпа отель Labe не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСпа отель Labe принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', '', '', '', NULL, NULL, NULL, NULL, 3, 0, 0, 0),
(25, 11, 'Санаторий Vltava-Berounkа', '', '["hotel.jpg","1.jpg","2.jpg","3.jpg","4.jpg"]', 'Отель находится в тихой части города на Английской улице, которая параллельна Главной улице города, и обе эти улицы формируют центр города Марианские Лазни.\r\n\r\nДо курортной колоннады от отеля всего 10 минут прогулочным шагом. За отелем начинается лесопарк со множеством дорожек для прогулок, и панорам на город и окружающие дали.\r\n', 'Курортный комплекс состоит из двух отелей — ВЛТАВА и БЕРОУНКА, соединенных коридором,отреставрированный вестибюль с лобби-баром и новой рецепцией, 80 номеров, летняя терраса с лежаками и тентами, ресторан «Регина». Собственный минеральный источник, Для отдыхающих — свободное посещение бассейна с вирпулом, сауной и фитнес-центром.\r\n \r\nЛечебные и СПА процедуры: минеральные ванны с сухим обертыванием, грязевые обертывания, процедуры с природным СО2, реабилитационная гимнастика, солярий, косметика, парикмахерская, маникюр, педикюр, интернет.\r\nОтель для некурящих.\r\n', 'Вы платите по прибытии в Санаторий Vltava-Berounkа.\r\n\r\nСанаторий Vltava-Berounkа не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении.\r\n\r\nИнформация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Vltava-Berounkа принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Ресторан «Регина»\r\n\r\nОтдыхающие выбирают по своему желанию блюда из меню чешской и международной кухни или из списка диетических блюд.\r\nТанцевальные вечера и различные мероприятия культурной программы.\r\nВместимость: 180 мест.\r\nЧасы работы:\r\nЗавтраки 7.00 — 10.00\r\nОбеды 11.30 — 14.00\r\nУжины 18.30 — 20.00\r\n\r\nСервировка:\r\nЗавтраки: шведский стол\r\nОбеды: выбор из 5 вторых блюд, салатовый буфет\r\nУжины: шведский стол\r\n\r\nРесторан a la carte\r\nДиеты: диабетическая, щадящая, вегетарианская, рациональная, для похудания, низкожировая, другие диеты по желанию.\r\n\r\nКафе «Бероунка»\r\nУютная обстановка с прекрасным выбором напитков и десертов.\r\nВместимость 26 мест.\r\nЧасы работы:\r\nПонедельник — пятница 9.00 — 22.00\r\nСуббота — воскресенье 9.00 — 13.00, 17.00 — 22.00\r\n\r\nЛетняя терраса, вместимость 20 мест\r\nЧасы работы: 10.00 — 20.00\r\n\r\nЛобби-бар\r\nУютная атмосфера с прекрасным выбором десертов, напитков — из собственной кулинарии, изысканных блюд.\r\nВместимость: 32 места.\r\nЧасы работы: 9.00— 21.00\r\n\r\nЛечение и красота\r\n\r\nВ санатории «Влтава и Бероунка» расположены кабинеты врачей и лечебные отделения, где отдыхающие проходят комплексное курортное лечение, направленное на преодоление недуга опорно-двигательного аппарата. Курортное лечение основано на процедурах, использующих местные целебные средства: минеральная ванна из Балбинова источника, питьевой курс, газовые уколы, грязевые укутывания, сухие газовые ванны СО2, ингаляции, различные виды ванн и массажи, водолечение с использованием бассейна, и множество других лечебных и релаксачных процедур. Фитнес- зал.\r\n \r\nСпециализация: общая реабилитация\r\n24-часовое дежурство врача и медсестры\r\n \r\nКрасота и здоровье: бассейн с подводными течениями, сауна, вирпул, парикмахерская, солярий, косметика, педикюр, маникюр.\r\nОсмотры врача: понедельник — пятница 7.00 — 15.00\r\nПроцедуры:\r\nпонедельник — пятница 7.00 — 12.00\r\nсуббота — воскресенье только по заказу\r\n\r\nБассейн:\r\nпонедельник — пятница 15.00 — 21.00 ( кроме среды)\r\nсуббота 14.00 — 21.00\r\nвоскресенье 8.00 — 12.00, 14.00 — 21.00\r\nдля отдыхающих — свободное посещение бассейна\r\nсауна: (90гр.С)\r\nпонедельник — воскресенье 16.00 21.00 (только по заказу).\r\n     \r\n', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(26, 11, 'Санаторий Grandhotel Pacifik', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Санаторий ПАЦИФИК находится на Главной улице — как заверщающий красивый финал проспекта, само здание заметно отличается от других двумя скульптурами на самом верху.\r\n\r\nМесто нахождения — недалеко от колоннады с источниками и музыкального фонтана.\r\nСанаторий специализируется на проблемах дыхательных путей. В санатории есть минеральный источник.', 'Санаторий располагает 95 комфортабельными номерами, ресторан «Примавера» с аквариумом и прекрасной панорамой на курортный центр города, лобби-бар, многофункциональный салон «Капитан Джеймс Кук» оборудован для конференций, есть библиотека и телевизор.\r\n\r\nБассейн с водными процедурами, сауна, санарий, вирпул, тропический душ, фитнес-центр, терапия Кнейппа. Детский уголок. Питьевой курс можно проводить прямо в отеле, в вестибюле есть минеральный источник.\r\n\r\nЛечебные и СПА процедуры: минеральные ванны с сухим обертыванием, с природным СО2, солярий, грязевые обертывания, различные виды массажей, лазерный центр, солнечная световая терапия. Интернет- за дополнительгую плату.', 'Вы платите по прибытии в Санаторий Grandhotel Pacifik.\r\n\r\nСанаторий Grandhotel Pacifik не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Grandhotel Pacifik принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Отель для некурящих.\r\n\r\nCheck-in - 14.00\r\nCheck-out - 12.00\r\nLate check-out -до 18.00  50% стоимости номера\r\n\r\nНомера: ванна или душ, спутниковое ТВ с российскими программами, сейф, телефон, интернет, халат для ванны — приготовлен в номере.\r\n\r\nПИТАНИЕ\r\n\r\nРесторан «Примавера»- широкий выбор блюд средиземноморской и итальянской кухни, легкие блюда с макаронами\r\nВместимость: 167 мест\r\nЧасы работы:\r\nЗавтраки 7.00 — 10.00\r\nОбеды: 11.30 - 14.00\r\nУжины: 17.30 — 20.30\r\na la carte  11.30 — 14.00,  17.30 — 20.30\r\n\r\nСЕРВИРОВКА:\r\n\r\nЗавтраки: шведский стол\r\nОбеды: сервируются, выбор из 5 вторых блюд, салатовый буфет\r\nУжины: шведский стол, салатовый буфет\r\n\r\nРесторан  a la carte\r\nДиеты: вегетарианская, диабетическая, щадащая, другие диеты по желанию\r\nDanubius Healthy Choise:  здоровое питание.\r\n\r\nЛобби-бар\r\n\r\nУютная атмосфера с прекрасной панорамой города, легкие закуски и напитки.\r\nРазрешено курение\r\nВмесиммость: 50 мест\r\nЧасы работы: 10.00 — 22.00\r\n\r\nСалон «Капитан Джеймс Кук» - конференции и семинары.\r\nДля проведения мероприятий — фирменные презентации, школы, семинары, предлагает свои услуги салон «Капитан Джеймс Кук», оборудованный в стиле кают-кампании, максимально 50 человек.\r\n\r\nЛЕЧЕНИЕ И КРАСОТА\r\n\r\nПолученный отелем чешский сертификат MEDISPA  гарантирует высокий уровень курортного лечения. Обслужат вас коллектив врачей-профессионалов и медперсонала. Лечебное отделение с современным оборудованием предоставит вам комплексное курортное лечение с начальным и конечным осмотром врача, консультации по ходу лечения и выдачей итогового заключения врача. Приоритет — лечебные процедуры на базе природных целебных средств: минеральные ванны «Лесной источник», сухие газовые ванны СО2, грязевые укутывания, питьевой курс. В вестибюле отеля выведен «Лесной источник» для питьевого курса.\r\n\r\nСПЕЦИАЛИЗАЦИЯ: заболевания дыхательного аппарата, ревитализация. 24 - часовое дежурство врача и медсестры.\r\nОсмотры врача:\r\nПонедельник — пятница 7.00 — 15.00\r\nСуббота — воскресенье по необходимости\r\nПроцедуры:\r\nПонедельник — пятница 7.00 — 16.00\r\nСуббота — 7.00 — 16.00 — только выбранные процедуры\r\nВоскресенье 8.00 — 16.00 — только выбранные процедуры.\r\n\r\nБассейн:\r\nПонедельник — пятница 12.00 — 21.00\r\nСуббота- воскресенье 9.00 — 21.00\r\nСауна: ( 90 гр.С0\r\nПонедельник — пятница 12.00 — 21.00\r\nСуббота — воскресенье 9.00 — 21.00\r\n\r\nСАЛЯРИЙ: (60гр.С)\r\nПонедельник — пятница 12.00 — 21.00\r\nСуббота — воскресенье 9.00 — 21.00\r\nСолнечный остров: неповторимый солнечный остров со световой терапией и песчаными лежаками с подогревом\r\nПонедельник- воскресенье по заказу.\r\nДети — лечение с 6 лет, от 4 лет — профилактическое лечение, дети до 4 лет бесплатно.       \r\n                               \r\n', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(27, 11, 'Санаторий Maria Spa', '', '["1.jpg","2.jpg","3.jpg","4.jpeg","5.jpeg"]', 'Уникальный проект МАРИИНЫ ЛАЗНИ  воплощает в себе историю Марианских Лазней.  Недавнее восстановление отеля  позволило расширить исторический комплекс Центральных, Новых и Марииных  Лазней,  который теперь является самым красивым  и прекрасно сохранившимся  памятником  курортной архитектуры  не только в Чешской Республике, но и во всей Европе.', 'Курортный комплекс  специализируется  на лечении заболеваний  с применением  природных средств,  мало того — был первым в Европе и одним из первых в мире, где в лечебном процессе  использовались лечебные грязи. Мариины Лазни находятся над источником природного газа СО2 — газ Марии, который дал название городу. Вам предложат оригинальные процедуры-  грязевые конверты, групповые ингаляции и эксклюзивное Мариино озерцо с кислородной ингаляцией. Минеральный источник Новая Мария выведен для питьевого курса в вестибюле отеля.\r\n', 'Вы платите по прибытии в Санаторий Maria Spa.\r\n\r\nСанаторий Maria Spa не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Maria Spa принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Питание:\r\n\r\nчешские и международные кухни, диетические блюда. Завтраки и ужины — разнообразный шведский стол, обеды с сервировкой, буфет с выбором салатов. Danubius Healthy  Choice - уголок здорового питания.\r\nПитание организовано в ресторане Гете в Центральных Лазнях. Сертификаты TUV, Medispa.\r\n \r\nГРЯЗЕВЫЕ ванны в Марианских Лазнях — уже в 1903 году здесь предоставлялось более 1000 процедур в день. Один из основателей курорта, доктор Неер, использовал природную грязь для укутывания ног и рук. Доктор Хайдлер впервые опробовал общую грязевую ванну в 1823 году.\r\nМариина минеральная ванна с добавками торфа — процедуры принимаются в исторической ванне, облицованной дубом, температура воды 34 гр. С, торф добавляется непосредственно в минеральную ванну. Процедура улучшает кровообращение,\r\nпонижает давление, снимает стресс, насыщает кожу полезныцми веществами из торфа, улучшает фукцию сердца. После процедуры необходимо принять душ смесью воды минерального источника и тёплой воды.\r\n\r\nМАРИИНО озерко с кислородом.\r\nЭта уникальная процедура принимается в оригинальном бассейне, в котором пациенты до пояса погружены в атмосферу природного газа СО2, непосредственно из источника Марии. Процедура проводится в сочетании с кислородной терапией и релакс-эффектами: методика проведения этой процедуры идет с 1905 г. Процедура улучшает кровообращение, повышает насыщение гемоглобина кислородом, что замедляет  процесс старения и способствует регенерации клеток. Рекомендация: при приёме процедуры пользоваться ремнями безопасности. После рекомендуется отдых на кушетке.\r\n\r\nМАРИИН ГРЯЗЕВОЙ МАССАЖ\r\nПроцедура представляет собой  классический массаж с грязевой эмульсией и массажными маслами. Помогает при болезнях опорно-двигательного аппарата, приводит к проникновению в организм полезных веществ через кожу, оказывая косметический эффект. Массажный стол Hasslauer представляет собой стол с подогревом массажной поверхности.\r\n\r\nМАРИИНА ИНГАЛЯЦИЯ\r\nПроцедура основана на ингаляции с природной минеральной водой Мариина источника и лекарствами, помогающими удалению мокрот и очищению дыхательных путей. Процедура рекомендована при лечении хронических заболеваний дыхательных путей, аллергии, для профилактики частых простуд, инфекций верхних дыхательных путей.\r\n     ', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(28, 11, 'Санаторий Butterfly', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'На Главной улице курорта Марианские Лазни напротив парка раскинулся прекрасный современный отель БАТТЕРФЛЯЙ. Отель находится на месте исторического строения конца 19 столетия. Реконструкция была проведена в 1995 году. Отель предлагает своим клиентам комфорт международного класса.', 'Отель располагает 96 комфортабельными номерами, семейные апартаменты, ресторан Ла Фонтен, ресторан Кафе де Пари, лобби-бар. Для отдыхающих — свободное посещение бассейна с вирпулом и сауной, баром, вид на курортный парк, летняя терраса. Собственный минеральный источник в вестибюле. Лечебные и спа процедуры: минеральные ванны с сухим обертыванием, различные виды массажей, реабилитационная гимнастика, центр красоты, парикмахерская. Конференц-зал Беллевью с современным техническим оборудованием, вместимостью 100 чел., салон «Король Эдуард» для конференций, вместимость 60 человек. Интернет. Подземный гараж.', 'Вы платите по прибытии в Санаторий Butterfly.\r\n\r\nСанаторий Butterfly не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Butterfly принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Отель для некурящих.\r\n\r\nСпециализация санатория — процедуры для сохранения красоты, а также конгрессы и конференции.\r\n\r\nОписание номеров: 96 номеров категории Супериор, из них 8 — Апартаменты и один номер Апартаменты -Люкс: ванна, джакузи, душ, подключение к интернету.\r\nДуш, туалет, телевизор, телефон, радио, интернет, кондиционер, фен, халат.\r\n\r\nРЕСТОРАН ЛА ФОНТЕН\r\nФранцузский ресторан с фонтаном и салоном с керамическими картинами Мадам Баттерфляй. Ваш ужин будет сопровождаться звуками арфы. Выбор блюд на любой вкус — чешская, венгерская, международные кухни, повара — мастера своего дела, отборные вина.\r\nВместимость: 140 мест.\r\nЧасы работы:\r\nЗавтраки 7.00 — 10.00\r\nОбеды 11.30 — 14.00\r\nУжины 17.30 — 21.00\r\nA la carte 11.30 — 14.00, 17.30 — 21.00\r\n\r\nСервировка:\r\nзавтраки: шведский стол с богатым выбором\r\nобеды и ужины: сервируются, выбор из 6 вторых блюд\r\nресторан a la  carte\r\nдиеты: вегетарианская, без клетчатки, для похудания, другие диеты по желанию\r\nDanubius Healthy Choice: здоровое питание\r\n\r\nЛобби-бар\r\nУютная атмосфера с прекрасным выбором напитков, десертов из собственной кулинарии, изысканные блюда.\r\nВместимость: сорок мест\r\nЧасы работы: 11.00 — 22.00\r\n\r\nКафе де Пари\r\nИнтерьер украшен деревянными скульптурами героев французской истории. Завтраки — шведский стол, уголок био-и здорового питания. Возможность проведения тематических вечеров, выход на террасу.\r\nВместимость 90 мест.\r\nЧасы работы: по договоренности\r\n\r\nСалон Bellevue- современный зал для конференций с панорамой на Главную улицу и парк\r\n\r\nKing Edvard *s  club - традиционная клубная атмосфера и конференц - зал в английском стиле.\r\n\r\nЛечебные услуги\r\n\r\nГости отеля могут опробовать процедуры на базе местных натуральных средств: минеральные ванны с водами Мариансколазенского Фердинанда, процедуры с использованием местных грязей, газовые конверты СО2 и газовые инъекции, магнитотерапия, электролечение, классический массаж, парафиновые ванночки, парафанго, реабилитационные упражнения, гимнастика в бассейне, гидротерапия. Профессиональный медосмотр и последующие консультации прямо в отеле.\r\n\r\nПолученный нами чешский сертификат MEDISPA - гарантия высокого уровня курортного лечения.\r\nВелнес центр ( Понедельник — воскресенье 07.00 — 21.00) :\r\nплавательный бассейн с противотечением\r\nвирпул с баром\r\nсауна(90гр.С)\r\n\r\nВелнес — фитнес:\r\n\r\nвелнес массажи\r\nцентр красоты — новые косметические процедуры с эксклюзивной природной косметикой:\r\nфитнес — центр\r\nгимнастика в воде\r\nДежурство врача — 24 часа, осмотры — по прибытии клиентов.\r\nПроцедуры:\r\nпонедельник — пятница: 08.00 — 17.00\r\nсуббота — воскресенье 08.00 — 17.00 ( отдельные процедуры)\r\nБассейн:\r\nпонедельник- воскресенье (07.00 — 21.00\r\nсауна:\r\nпонедельник — воскресенье (07.00 — 21.00\r\nдля отдыхающих — бесплатное посещение бассейна', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(29, 11, 'Санаторий Imperial', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Марианские Лазни со дня своего основания становятся известным курортом, сюда часто приезжали члены многих королевских семей. Сохраняя память об их приездах, было решено построить на месте, где раньше стоял санаторий  «У Австрийского императора» , новое здание в имперском стиле — ИМПЕРИАЛ.', 'Санаторий располагает 36 номерами-люкс, 40 мест — подземная парковка, лобби-бар, кафе «Империал». Совместно с «Неапол Спа Центр» входит в уникальный исторический комплекс «Звезда».\r\n\r\nЛечебные и СПА прцедуры: кабинеты врачей и лечебные отделения в отеле «Звезда», новое лечебное отделение «Неапол Спа Центр», комплексное курортное лечение, лечебные процедуры на базе природных лечебных средств — минеральные ванны, грязевые конверты, сухие углекислые ванны, газовые инъекции, водолечение и широкий спектр лечебных процедур. Некоторые процедуры отдыхающие принимают в отелях Центральные Лазни и Мариины Лазни. Для минеральных ванн используется источник Балвина, находящийся прямо в отеле.\r\nАква-центр с большим бассейном (150 кв.м ), вирпул, 2 сауны, парная, тепидарий, соляная пещера.\r\nКосметический салон Beauty Comfort Zone.\r\n\r\nСоединение крытыми переходами с санаториями Новые Лазни, Центральные Лазни, Мариины Лазни.\r\nЗа оплату: соляная пещера, ванны, массажи, сигорол, слайдстайлер, парафанго, косметический салон, антицеллюлитные программы, парикмахерская.\r\nСертификаты:\r\nTUV, EuropeSpa med, Medispa.\r\n', 'Вы платите по прибытии в Санаторий Imperial.\r\n\r\nСанаторий Imperial не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Imperial принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Проживание\r\n134 номера категорий  Superior, Superior Plus, Suite и апартаменты. Есть детский уголок, интернет, парковка, подземный гараж.\r\n\r\nГастрономия\r\nСтильный интерьер, большой выбор чешской и международной кухни, диетпитание. Завтраки и ужины — разнообразный шведский стол, обеды с сервировкой, буфет с выбором салатов,  Danubius Healthy Choice уголок здорового питания. Рестораны «Франц Иосиф и Сисси», лобби-бар, кафе «Империал», 2 летние террасы, атриум.\r\n\r\n', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(30, 13, 'Санаторий Radium Palace', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Санаторий «Радиум Палас» расположен в живописном месте курорта Яхимов, возле лесного массива. Санаторий имеет большой лечебно-оздоровительный центр - в него подведена радоновая вода для прохождения главной лечебной процедуры «радоновая ванна». «Радиум Палас» был специально спроектирован для удобств людей с ограниченными физическими возможностями - в нем предусмотрены безбарьерные переходы, низкие ступеньки и поручни.', 'Санаторий «Radium Palace», прежде всего, имеет серьезную лечебную базу, которая позволяет лечить широкий спектр заболеваний опорно-двигательного аппарата. Медицинский персонал санатория достаточно квалифицированный, имеет опыт лечения и реабилитации пациентов с заболеваниями различной степени сложности. «Радиум Палас» оптимально подойдет гостям курорта, которые предпочитают проживать в комфортных условиях.', 'Вы платите по прибытии в Санаторий Radium Palace.\r\n\r\nСанаторий Radium Palace осуществляет временное блокирование 20% стоимости заказа на вашей банковской карте за 28 дней до заезда. Сумма физически не снимается с карты, а только временно блокируется на случай, если вами будет произведена отмена бронирования уже в период действия штрафных санкций.\r\n\r\nСанаторий Radium Palace принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'В санатории 4 ресторанных зала, клуб-бар, кафе в зимнем саду, плавательный бассейн, джакузи, фитнес-центр, сауна с купелью, для гимнастики – малый бассейн (1,5 на 2,5 м.), парикмахерская, косметический салон, библиотека, большой концертный зал, продажа сувениров, 3 салона (австрийский, французский, английский), обмен валюты, лечебно-диагностический центр, стоянка автомашин, экскурсии. \r\n\r\nЛечение:   в основном здании предоставляются все виды процедур, кроме специального лечения – брахирадиумтерапия, которое проводится в Институте брахирадиумтерапии напротив здания санатория.\r\nДети до 18 лет на лечение не принимаются. \r\n\r\nПроцедуры: радоновые ванны, гейзерные ванны, гальванические ванны, вихревые ванны, жемчужные ванны, ванны с добавками лекарственных трав, лечебная физкультура в бассейне, массажи – подводный, классический, рефлекторный, ингаляции, магнитотерапия, лимфодренаж, лазерная терапия, криотерапия, фототерапия, акупрессура.\r\n', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(31, 13, 'Санаторий Akademik Behounek', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg","6.jpg"]', 'В центральной зоне курорта Яхимов находится здание санатория АКАДЕМИК БЕГОУНЕК, построенное в  1975 году с видом на живописную Яхимовскую долину.\r\n\r\nЯхимов стал первым в мире радоновым курортом, который  находится в предгорных лесах северо-западной части Чехии. Главный фактор лечения здесь – минеральная вода с высоким содержанием газа радона, который оказывает целебное воздействие при заболеваниях опорно-двигательного аппарата. С начала прошлого века здесь стали проводить процедуры – радоновые ванны, которые позволяют избавиться от болей и проблем в области позвоночника, суставов, связок, возвращая телу человека легкость и подвижность.\r\n', 'Обладая хорошими климатическими условиями – мягкая зима и умеренно жаркое лето – санатории курорта работают круглый год.\r\n\r\nСанаторий располагает 243 номерами кат. «стандарт»  на 320 человек. В номерах: ванная комната, спутниковое ТВ с российским программами, интернет, мини-бар, холодильник, балкон. Дети любого возраста – в сопровождении взрослых.\r\n', 'Вы платите по прибытии в Санаторий Akademik Behounek.\r\n\r\nСанаторий Akademik Behounek осуществляет временное блокирование 20% стоимости заказа на вашей банковской карте за 28 дней до заезда. Сумма физически не снимается с карты, а только временно блокируется на случай, если вами будет произведена отмена бронирования уже в период действия штрафных санкций.\r\n\r\nСанаторий Akademik Behounek принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Санаторий имеет собственный  лечебно-диагностический центр – в процедурные  кабинеты  подаются радоновые воды из 4 минеральных источников: С1, Агрикола, Кюри, Бегоунек с темп. 26°С. После заселения отдыхающий проходит врачебный осмотр и лабораторные исследования. Исходя из анализов и осмотра назначается индивидуальное лечение. После прохождения всех процедур – врачебный осмотр и медицинское заключение.\r\n\r\nСпециализация санатория: заболевания костно-мышечной системы и опорно-двигательного аппарата (артрозы и полиартрозы, артриты, сколиоз, остеохондроз позвоночника, анкилозирующий спондиллит, последствия термических и химических ожогов, остеомиелит хронический, реабилитация после травм). \r\nУслуги по лечению заболеваний: \r\nЭндокринной системы (сахарный диабет, ожирение).\r\nКожных болезней (псориаз, дерматит, нейродермит).\r\nПериферийной и центральной нервной системы (последствия травм, воспалительные болезни центральной нарвной системы и др.).\r\n\r\nЛечебные процедуры: бальнеологическое лечение, гидротерапия (лечебные ванны), климатолечение, сухая углекислая ванна, галотерапия, физиотерапия, криотерапия, вибротерапия, парафинотерапия, массажи, лечебная гимнастика,  посещение ванны и сауны.\r\n\r\nПитание в санатории – по рекомендации врача, есть диетпитание.\r\nДля отдыхающих санатория – бассейн, фитнес-центр, сауна, косметика, парикмахерская.\r\nОптимальный эффект от лечебно оздоровительных процедур – после трехнедельного пребывания в санатории. ', '', '', NULL, NULL, NULL, NULL, 3, 0, 0, 0),
(32, 13, 'Санаторий Curie ', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Санаторий КЮРИ 3* находится в курортном центре г. Яхимов, был построен в 1992 году, летом 2004 года прошел полную реконструкцию. Санаторий связан крытым коридором с курортными домами «Электра» и «Прага». ', 'Санаторий располагает 128 местами в одно-  и двухместных номерах. Номера оснащены душем или ванной, туалет, спутниковое ТВ с российскими программами, холодильник, телефон, сейф.\r\n', 'Вы платите по прибытии в Санаторий Curie.\r\n\r\nСанаторий Curie осуществляет временное блокирование 20% стоимости заказа на вашей банковской карте за 28 дней до заезда. Сумма физически не снимается с карты, а только временно блокируется на случай, если вами будет произведена отмена бронирования уже в период действия штрафных санкций.\r\n\r\nСанаторий Curie принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Питание: трёхразовое (завтрак в форме буфета, обед и ужин – меню по заказу) проводится в 2 просторных столовых санатория.\r\n\r\nПоказания к лечению:   заболевания опорно-двигательного аппарата, заболевания периферической нервной системы, невралгии, неврозы, аутоимунные системные заболевания, вертеброгенный альгический синдром, суставные осложнения при заболеваниях метаболизма.\r\n\r\nЛечение:   радоновые ванны, индивидуальная и групповая гимнастикка, водная гимнастика, массажи, аэрозольные ингаляции, электро-, магнитная и лазерная терапия, лимфодренаж, подводный массаж HIDROXER , гидротерапия,реабилитация, ванны – жемчужные, с добавками, вихревые, подводного массажа, углекислая с обёртыванием, физиотерапия, газовые уколы, биолампа, кислородотерапия, инфракрасное облучение «солюкс», компресс  VULKAN PACK, парафиновые компрессы, акупунктура, сухие углекислые ванны,  душ ШАРКО.\r\nМедицинское обслуживание – 24 часа. Лечебные процедуры и медуслуги оказываются также тяжелобольным пациентам.   Лечение детей – от 16 лет!\r\n\r\nУслуги: библиотека, парикмахерская, косметический и педикюрный зал, интернет-кафе, обменный пункт, автостоянка.', '', '', NULL, NULL, NULL, NULL, 3, 0, 0, 0),
(36, 15, 'Abano Grand Hotel', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Отель расположен в историческом центре Абано Терме, в пешеходной зоне, в 60 км  от международного аэропорта  Венеции, в 10 км  от города Падуя.\r\n', 'Отель отличается размером номеров  ( минимально 35 кв.м.), мебель в стиле Людовика XV, просторные светлые ванные комнаты из зелёного и розового мрамора. Номера :  гостиные и прихожая с каминами и двумя ванными комнатами. Отель располагается в огромном парке с оливами, пальмами, тропическими растениями, три больших термальных бассейна, соединенных между собой (крытый со струйным массажем Кнейппа, другой с джакузи и гидромассажной ванной и различными водными процедурами).\r\n\r\nОздоровительный центр предлагает разнообразные лечебные программы. После проведения медобследования вам предложат различные физиотерапевтические процедуры, грязелечение, различные вида массажа, бальнеотерапию, термальные ванны и многое другое.\r\n', 'Abano Grand Hotel взимает 100% стоимости заказа с вашей банковской карты за 13 дней до заезда.\r\n\r\nAbano Grand Hotel принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Ресторан: европейская, итальянская, вегетарианская кухни, лобби-бар.\r\nТермальный СПА центр:\r\nПрофессиональные врачи,  специалисты термальной медицины после медосмотра выберут  нужную вас программу лечения. Все процедуры выполняются под наблюдением медперсонала. У врача диетолога можно получить консультацию по питанию. Косметологи  СПА центра предложат Вам новинки в области косметологии, к примеру, как «Виноградная терапия», которая включает в себя процедуры по уходу за кожей лица и тела на основе целебных компонентов винограда. Программа рассчитана на 7 дней.\r\n\r\nПроцедуры: диагностика, бальнеотерапия, грязелечение, ингаляция и аэрозоли, гидромассажи, косметика, аква-гимнастика, пассивная и активная гимнастика, консультация врача – терапевта, ортопеда, диетолога. \r\n\r\nПрограммы: антистресс, похудение, очистка организма, красота, классическое термальное лечение, фитнес. \r\n\r\nЭксклюзивные процедуры: перистальтическая прессотерапия, «Виноградная терапия» , омоложение кожи, питательные процедуры по уходу за лицом и телом.\r\n\r\nУслуги: салон красоты, фитнес – центр, центр СПА, парикмахерская, солярий.  За доп.плату можно совершить экскурсии в близлежащие города – Венецию, Падую, Верону.\r\n', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0),
(37, 15, 'Grand Hotel Trieste & Victoria', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Отель Гранд Отель Терме в Триесте Виктория, исторический отель курорта Абано Терме (основан в 1913 году), расположен в центре пешеходной зоны. Отель после генеральной реконструкции сохранил свой особенный шарм и элегантность, пользуясь славой эксклюзивного отеля Абано Терме. Отель расположен в огромном парке с двумя бассейнами с термальной водой, гидромассажами, противоток, водопады, соединенные с крытым бассейном. \r\n', 'Grand Hotel Trieste & Victoria является одним из самых роскошных на курорте Абано Терме. Его отличает не только высокий уровень комфортабельности, но и отличные условия для комплексного курортного лечения с широким спектром лечебно-оздоровительных процедур.', '', 'Тренажёрный зал, солярий, парикмахерская, термальный грот, Beauty Center с широким спектром процедур от традиционного грязелечения и бальнеотерапии до методик восточной медицины.\r\n\r\nТермальный СПА центр: профессиональные врачи, специалисты термальной медицины,  проведут медобследование и назначат вам индивидуальное лечение. Все процедуры выполняются под наблюдением медперсонала. У врача- диетолога можно получить консультацию по правильному питанию.\r\n\r\nПроцедуры: грязелечение, диагностика, бальнеотерапия, ингаляции и аэрозоли, гидромассажи, массотерапия, кромотерапия, аромотерапия, косметические процедуры по уходу за лицом и телом, аква-гимнастика, активная и пассивная гимнастики, консультация врача терапевта, ортопеда, диетолога.\r\n\r\nПрограммы: антистресс, очистка организма, похудение, антивозраст, красота, классическое термальное лечение, фитнес. \r\n', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0),
(38, 11, 'ESPLANADE', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg","6.jpg"]', 'Санаторий расположен в прекрасном лесопарке. Отель был построен в 1911 году, архитектор Арнольд Хейманн, является одним из красивейших отелей в Марианских Лазнях. Гостями отеля в разное время были индийские принцессы и махараджи, князья, члены королевских семей, банкиры. Была проведена большая реконструкция, но колорит и шарм были сохранены. Отель предлагает курортные услуги и роскошное проживание, не имеющие аналогов.\r\n', '', '', 'Развлечения и услуги. Салоны: МОЦАРТ, ШОПЕН, ДВОРЖАК, МОСТ, ГЕТЕ, КОЛОННАДА — 300 мест, 1000 мест для раута, некрытая автостоянка-40 мест, гараж — 15 мест, парикмахерская, педикюр, маникюр, секретарские услуги, косметический салон, услуги няни, конференц-зал, 4 салона, интернет, обмен валют.\r\n\r\nРазмещение\r\nВ отеле 110 комфортабельных номеров, из них 64 Dblsuperior, 19 apartament suite, 4  apartament suite, 2 apartament suite, 1 бельэтажный апартамент «Эспланаде», есть номера для курящих.\r\nВо всех номерах: ванная комната ( в апартаментах мраморные ванные комнаты оснащены гидромассажной ванной и душевой кабиной, фен, телефон, туалетный столик с зеркалом), туалет, телефон, факс — за доп.плату, сейф, телевизор, кондиционер, мини-бар, интернет, халат и тапочки. Номера с видом на лес или горы. Во всех апартаментах балкон или терраса.\r\n\r\nПитание\r\nЗавтраки, обеды и ужины проходят в ресторане гостиницы.\r\nЗавтрак: 07.00 — 10.00 шведский стол, большой выбор салатов, горячих и холодных блюд, сладкого.\r\nОбед: 12.00 — 23.00 выбор «а ля карт», возможность выбора из диетического меню\r\nУжин: 18.00 — 23.00 выбоp «а ля карт», возможность выбора из диетического меню.\r\n\r\nЛечение\r\nВремя работы: понедельник — воскресенье с 08.до 22.00\r\nлечение детей от 8 лет.\r\n\r\nСанаторий имеет собстенный бальнео-центр: джакузи, грязевые обертывания, реабилитация-упражнения, ванны с травами и растительными экстрактами, ингаляция, ванны — минеральные, углекислые, душ Шарко, консультация врача, массажи — классический, лица, подводный, рефлекторный, газовые уколы, торфяное обертывание, сухая газовая ванна, гимнастика в бассейне, диатермия, ЭКГ, оксигенотерапия, магнитотерапия, лимфодренаж, парафиновое обертывание, парафиновый компресс рук, ванна жемчужная, лечебная физкультура, купание в соли Мертвого моря, косметика, маникюр, педикюр, пилинг, массаж ароматический, медовый массаж, тайский массаж, уход за кожей лица и тела.  ', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0),
(39, 15, 'Спа Отель Terme Due Torri ', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Романтичный отель с уютной атмосферой ДУЭ ТОРРИ расположен в непосредственной близости от пешеходной зоны Абано Терме рядом с историческим парком. Отель окружён парком из пальм и тропических растений с разноцветными цветочными клумбами, аура умиротворения для влюбленных парочек. Отель оборудован по последнему слову техники и предлагает специализированные программы по общей детоксикации организма. \r\n', 'Отель расположен в центре термального курорта Абано Терме, в 45 км. от международного аэропорта Марко Поло, Венеция, и в одиннадцати км. от г. Падуя.', 'Спа Отель Terme Due Torri взимает 100% стоимости заказа с вашей банковской карты за 13 дней до заезда. \r\n\r\nСпа Отель Terme Due Torri принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Каждый номер оборудован большой ванной комнатой с душем. Номера просторные, оформлены в стиле конца 19 века. Номера категории  Suite имеют балконы. Кондиционер, телефон, телевизор, радио,сейф, интернет, мини –бар, фен.\r\nПитание: полупансион, пансион. \r\nСПА центр  SPA beauty & Fitness Center, который состоит из современного термального СПА отделения, грязелечение, термальный грот, тренажёрный зал, салон красоты. Здесь можно пройти курс массажа, заказать услуги за лицом и телом и различные лечебные процедуры. Два соединяющихся бассейна с термальной водой: большой крытый бассейн «Афродита» с ножными ваннами Кнайпа соединен с открытым бассейном «Посейдон» с гидромассажами, противотоком, вирпул, небольшой бассейн с пресной водой «Венера», прогулки на велосипедах, парковка, гараж.\r\n', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0),
(40, 15, 'Санаторий La Residence & Idrokinesis', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Отель Ла Резиданс  находится недалеко от пешеходной зоны Абано Терме.  После обширной реконструкции (2005 г.) отель превратился в термальный реабилитационный центр. Специализация – физиокинезитерапия и реабилитация в термальной воде. Отель стоит окруженный большим парком с пальмами, оливами, экзотическими растениями.\r\n', 'Комфортабельные номера отеля  оформлены в элегантном стиле по  современным стандартам.  Ванные комнаты отделаны мрамором,  к услугам гостей бары,рестораны,  три больших термальных бассейна – крытых и открытых, соединенные между собой, с гидромассажами, противотоком,  водопадами  -  настоящий тренажерный  водный зал, термальный грот, огромный спектр  процедур, проходящих с использованием целебных свойств термальных источников.', '', 'Услуги: парковка, интернет, конференц-зал, проживание с животными, номера для курящих, тенниссный корт,\r\nобмен валют, присмотр за детьми, гостиничные услуги, парикмахерская, маникюр, педикюр, прокат автомобиля, прокат велосипедов, услуги консьержа, услуги чистки одежды, услуги по глажке одежды.', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(41, 10, 'Санаторий Bristol Tereza', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', '«Tereza» - комфортабельный корпус в «Бристоль Палас» с небольшим количеством номеров (всего 22), что обеспечивает гостям тихий отдых. Лечение в санатории на высоком уровне, более 25 видов процедур, в том числе специальные физиотерапевтические процедуры, в частности, подводное вытяжение позвоночника. В медицинской лаборатории санатория проводят разнообразные лабораторные анализы по выявлению состояния уровня сахара и жиров в крови, специальные исследования при всех типах сахарного диабета, определению состояния печени, почек и мочевыводящих путей, верхних дыхательных путей, степени риска развития атеросклероза, диагностику преддиабетического состояния. Гостям, придерживающимся диеты, предлагают качественное диетическое, диабетическое питание, также присутствуют и вегетарианские блюда. В санатории работает диетсестра, помогающая составить индивидуальную диету.', 'Санаторий «Tereza» является частью санатория «Бристоль Палас» и расположен всего 1 минуту ходьбы по ровной местности к питьевым термальным минеральным источникам. \r\n\r\nВсе процедуры проходят в лечебном центре комплекса «Бристоль», с которым «Tereza» соединен крытым переходом. Некоторые водные процедуры проводятся с использованием термальной минеральной воды, подведенной из источника непосредственно в здание санатория.\r\n\r\nБольшое значение в санатории уделяют сбалансированному питанию, как важной составляющей качественного лечения желудочно-кишечного тракта. Кроме классической международной и чешской кухни, гостям предлагаются диетические и диабетические блюда, а также вегетарианское питание. При необходимости, диетсестра составит индивидуальный план диетического питания.', 'Вы платите по прибытии в Санаторий Bristol Tereza.\r\n\r\nСанаторий Bristol Tereza не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Bristol Tereza принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express', 'Услуги\r\nобмен валют, гостиничные услуги, прокат велосипедов, услуги консьержа, услуги чистки одежды \r\n\r\nСпа и Велнес\r\nбассейн, джакузи, сауна, солярий \r\n\r\nЛечебное отделение\r\nмедицинский персонал, доктор, главная медсестра, физиотерапевт, массажист, диетолог', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(42, 10, 'Спа отель Wolker', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Спа отель «Wolker» подойдет гостям курорта, предпочитающим проживать в центре Карловых Вар, возле источников. Месторасположение является главным преимуществом спа отеля. Хороший уровень комфорта и спокойная домашняя обстановка подойдут для семейного отдыха с детьми.', 'Спа отель «Wolker» расположен в самом центре курортной зоны Карловых Вар. Прямо напротив Волкера, всего в 5 метрах расположена колоннада с первым источником "Гейзер", который чаще всего назначают для прохождения питьевого лечебного курса, до главной курортной колоннады с питьевыми термальными минеральными источниками - 3 минуты неспешной ходьбы.\r\n\r\n«Волкер» является частью санатория «Астория». В здании «Волкер» для гостей организовано исключительно проживание, а питание и лечение проводятся в здании санатория «Астория», до которого 3 минуты спокойной ходьбы.\r\n\r\n«Wolker» имеет просторные, комфортные номера, с хорошей звукоизоляцией, что располагает к спокойному отдыху.', 'Вы платите по прибытии в Спа отель Wolker.\r\n\r\nСпа отель Wolker не требует для осуществления бронирования предоставлять данные о вашей банковской карте.\r\n\r\nСпа отель Wolker принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro', 'Услуги\r\nобмен валют, услуги чистки одежды\r\n\r\nСпа и Велнес\r\nбассейн (8х4 метра, в санатории Astoria, ТОЛЬКО КАК ПРОЦЕДУРА), сауна (в санатории Astoria) \r\n\r\nЛечебное отделение\r\nмедицинский персонал (19), доктор (3), главная медсестра (1), медсестра (6), дежурная сестра, физиотерапевт (3), массажист (6)', '', '', NULL, NULL, NULL, NULL, 3, 0, 0, 0),
(43, 10, 'Luxury Spa Hotel Olympic Palace', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', '«Olympic Palace» является одним из самых новых спа отелей в Карловых Варах, и самым новым в категории 5 звезд. Это обстоятельство обуславливает его повышенную комфортабельность. Лечебная база спа отеля хорошо оснащена, и наличие подведенной термальной минеральной воды позволяет проводить классическое карловарское курортное лечение. «Олимпик Палас» оптимально подойдет для гостей курорта, требовательных к высокому уровню комфорта и желающим пройти комплексное лечение. Спа отель также удобен для отдыха и лечения с детьми, которых может осмотреть профессиональный педиатр', 'Luxury Spa Hotel OLYMPIC PALACE расположен в центре курорта Карловы Вары, 3 минуты ходьбы от питьевых термальных минеральных источников. \r\n\r\nОтличительной особенностью «Luxury Spa Hotel OLYMPIC PALACE» является его новизна – в 2015 году он прошел полную реконструкцию. Здание спа отеля является памятником архитектуры. Номера комфортабельные, с видом на лес или курортный центр Карловых Вар. Большинство номеров имеют балкон или террасу. \r\n\r\nСпа отель имеет собственное лечебно-оздоровительное отделение площадью 800 кв.м, расположенное непосредственно в здании «Олимпик Палас». В «OLYMPIC PALACE» подведена термальная минеральная вода, используемая при проведении некоторых водных процедур. Лечебное отделение открыто 7 дней в неделю, а врач работает с 8:00 до 20:00.\r\n\r\nВ лечебно-оздоровительном отделении спа отеля есть просторная соляная пещера с гималайской солью, которая является эффективным средством профилактики и лечения некоторых заболеваний верхних дыхательных путей.\r\n\r\n«OLYMPIC PALACE» специализируется и на лечении детей c 6 лет, поэтому в спа отеле работает педиатр. Детям до 6 лет процедуры назначаются только после обязательного осмотра ребенка врачом-педиатром.', 'Вы платите по прибытии в Luxury Spa Hotel OLYMPIC PALACE.\r\n\r\nLuxury Spa Hotel OLYMPIC PALACE не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nLuxury Spa Hotel OLYMPIC PALACE принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'Услуги\r\nобмен валют, присмотр за детьми, гостиничные услуги, парикмахерская, маникюр, педикюр, прокат автомобиля, услуги консьержа, услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн (12м x 8м), джакузи, сауна, соляная пещера\r\n\r\nЛечебное отделение\r\nмедицинский персонал (20 человек), доктор (2 человек), главная медсестра (1), медсестра (2), дежурная сестра, педиатр (1 человек), физиотерапевт (2), массажист (5), диетолог (1)', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0),
(44, 10, 'Grand Hotel Pupp', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', '«Grand Hotel Pupp» позиционируется как один из самых комфортабельных спа отелей в Карловых Варах, имеющий давнюю традицию обслуживания мировых знаменитостей, регулярно останавливающихся в этом спа отеле. В то же время, несмотря на наличие у «Grand Hotel Pupp» нового бальнеологического центра, в процедурах не используется основной лечебный фактор курорта – термальная минеральная вода. Спа отель идеально подойдет для гостей курорта, ориентированных на качественное обслуживание и проживание в комфортабельных условиях.', 'Спа отель «Grand Hotel Pupp» расположен в центре курорта Карловы Вары, всего 5 минут ходьбы по ровной местности к питьевым термальным минеральным источникам. В 2013 году спа отель реконструировал и значительно увеличил площадь своего лечебного отделения. По уровню обслуживания и комфортабельности «Grand Hotel Pupp» считается одним из лучших спа отелей на курорте. \r\n\r\nВсе лечебно-оздоровительные процедуры проводятся в собственном лечебном отделении, расположенном прямо в здании спа отеля.', 'Вы платите по прибытии в Grand Hotel Pupp.\r\n\r\nGrand Hotel Pupp не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nGrand Hotel Pupp принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'обмен валют, присмотр за детьми, гостиничные услуги, парикмахерская, маникюр, педикюр, прокат автомобиля, прокат велосипедов, услуги консьержа, стоматологический кабинет , услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн (15х7 метров), джакузи, сауна, соляная пещера \r\n\r\nЛечебное отделение\r\nмедицинский персонал, доктор, медсестра, дежурная сестра, физиотерапевт, массажист', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0);
