(45, 10, 'Санаторий Bristol Krаlovskа Villa', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Санаторий «Bristol Krаlovskа Villa» считается одним из самых комфортабельных в Карловых Варах. Его отличает очень высокое качество лечения, в котором используется широкий спектр лечебных и оздоровительных процедур, в том числе специальные физиотерапевтические процедуры, в частности, подводная вытяжка позвоночника. В медицинской лаборатории санатория проводят разнообразные лабораторные анализы по выявлению состояния уровня сахара и жиров в крови, специальные исследования при всех типах сахарного диабета, определению состояния печени, почек и мочевыводящих путей, верхних дыхательных путей, степени риска развития атеросклероза, диагностику преддиабетического состояния. Гостям, придерживающимся диеты, предлагают качественное диетическое, диабетическое питание, также присутствуют и вегетарианские блюда. В санатории работает диетсестра, помогающая составить индивидуальную диету.', '«Королевская вилла» является частью санатория «Бристоль Палас» и расположена в 3-х минутах ходьбы от источника питьевой термальной минеральной воды «Гейзер». \r\n\r\nВсе лечебные процедуры проходят в лечебном центре санатория «Бристоль Палас», с которым «Королевская вилла» соединена теплым крытым переходом. В лечебный центр подведена термальная минеральная вода из источника для проведения некоторых водных процедур.\r\n\r\nБольшое значение в санатории уделяют сбалансированному питанию, как важной составляющей качественного лечения желудочно-кишечного тракта. Кроме классической международной и чешской кухни, гостям предлагаются диетические и диабетические блюда, а также вегетарианское питание. При необходимости, диетсестра составит индивидуальный план диетического питания.', 'Вы платите по прибытии в Санаторий Bristol Krаlovskа Villa.\r\n\r\nСанаторий Bristol Krаlovskа Villa не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Bristol Krаlovskа Villa принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express', 'обмен валют, прокат велосипедов, услуги чистки одежды \r\n\r\nСпа и Велнес\r\nбассейн (5х25 метров), сауна, солярий \r\n\r\nЛечебное отделение\r\nмедицинский персонал, доктор, главная медсестра, медсестра, физиотерапевт, массажист', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(46, 10, 'Санаторий Spa Resort Sanssouci', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', 'Санаторий «Spa Resort Sanssouci» отличается качеством лечебного процесса, комфортностью в номерах, достаточно разнообразным, в том числе диетическим, питанием. Санаторно-курортный комплекс «Спа Ресорт Сансусси» позволяет проходить полный цикл лечения (питьевой курс термальной минеральной воды, лечебные и оздоровительные процедуры, отдых), фактически не выходя из него. Качество лечебного процесса в санатории подтверждается тем, что в «Spa Resort Sanssouci» работает самый лучший на курорте врач Мария Ребенкова.', '«Spa Resort Sanssouci» - это санаторно-курортный комплекс, состоящий из трех корпусов: «Blue House» и «Green House», а также виллы «Mercedes». Комплекс расположен вблизи лесного массива, в 15 минутах ходьбы от центра курортной зоны с питьевыми термальными минеральными источниками. В сравнении с другими лечебно-оздоровительными учреждениями Карловых Вар, лечебное отделение "Sanssouci" является одним из самых больших. \r\n\r\nВсе лечебно-оздоровительные процедуры проводятся в лечебном центре, расположенном прямо в здании санатория.', 'Вы платите по прибытии в Санаторий Spa Resort Sanssouci.\r\n\r\nСанаторий Spa Resort Sanssouci не требует для осуществления бронирования предоставлять данные о вашей банковской карте.\r\n\r\nСанаторий Spa Resort Sanssouci принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', '', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(47, 10, 'Санаторий Bristol Livia', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', '«Livia» - один из самых комфортабельных корпусов в «Бристоль Палас», номера в котором оформлены в стиле модерн. В «Ливии» гости отдыхают в тихой обстановке. Лечение в санатории на высоком уровне, более 25 видов процедур, в том числе специальные физиотерапевтические процедуры, в частности, подводное вытяжение позвоночника. В медицинской лаборатории санатория проводят разнообразные лабораторные анализы по выявлению состояния уровня сахара и жиров в крови, специальные исследования при всех типах сахарного диабета, определению состояния печени, почек и мочевыводящих путей, верхних дыхательных путей, степени риска развития атеросклероза, диагностику преддиабетического состояния. Гостям, придерживающимся диеты, предлагают качественное диетическое, диабетическое питание, также присутствуют и вегетарианские блюда. В санатории работает диетсестра, помогающая составить индивидуальную диету.', 'Санаторий «Livia» является частью санатория «Бристоль Палас» и расположен всего 1 минуту ходьбы по ровной местности к питьевым термальным минеральным источникам. \r\n\r\nВсе процедуры проходят в лечебном центре комплекса «Бристоль», с которым «Livia» соединен крытым переходом. Некоторые водные процедуры проводятся с использованием термальной минеральной воды, подведенной из источника непосредственно в здание санатория. \r\n\r\nБольшое значение в санатории уделяют сбалансированному питанию, как важной составляющей качественного лечения желудочно-кишечного тракта. Кроме классической международной и чешской кухни, гостям предлагаются диетические и диабетические блюда, а также вегетарианское питание. При необходимости, диетсестра составит индивидуальный план диетического питания.', 'Вы платите по прибытии в Санаторий Bristol Livia.\r\n\r\nСанаторий Bristol Livia не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСанаторий Bristol Livia принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express', 'обмен валют, гостиничные услуги, прокат велосипедов, услуги консьержа, услуги чистки одежды \r\n\r\nСпа и Велнес\r\nбассейн, джакузи, сауна, солярий \r\n\r\nЛечебное отделение\r\nмедицинский персонал, доктор, главная медсестра, медсестра, физиотерапевт, массажист, диетолог', '', '', NULL, NULL, NULL, NULL, 5, 0, 0, 0),
(48, 17, 'Grand Hotel Donat', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', '«Grand Hotel Donat» очень комфортабельный санаторий на курорте Рогашка Слатина. На качественном уровне организовано питание и обслуживание гостей. В «Grand Hotel Donat» модерновый велнесс-центр, где можно пройти релаксационные процедуры. Очень удобным, особенно в холодные месяцы года, является наличие теплого крытого перехода в медицинский центр “Рогашка” и питьевой павильон с лечебными минеральными источниками магниевой воды Донат Mg.', 'Отель расположен рядом с цветущим парком и не устает удивлять своих гостей широким спектром услуг. Отель был полностью обновлен и обставлен в современном стиле. Гости снова и снова с удовольствием возвращаются в отель Донат!\r\n\r\n«Гранд Отель Donat Superior» находится в центре курорта Рогашка Слатина, известного в Европе прежде всего уникальными лечебными свойствами природной минеральной воды «Донат Mg», богатой магнием. \r\n\r\nГранд Отель Donat Superior известен широким набором высококачественных услуг, владеющими иностранными языками кадрами и профессиональным индивидуальным подходом к гостям, он входит в число лучших санаториев Словении.\r\n\r\nВсе лечебные процедуры проводятся в Медицинском центре «Рогашка», с которым санаторий соединен теплым крытым 20-ти метровым переходом, где гости в халате ходят на процедуры, а также в питьевой павильон для приема лечебной минеральной воды «Донат Mg».', 'Вы платите по прибытии в Grand Hotel Donat.\r\n\r\nGrand Hotel Donat не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nGrand Hotel Donat принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, DC', 'парикмахерская, прокат велосипедов, услуги консьержа, услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн (внутренний 18х13 метров, внешний 15х10 метров), джакузи, сауна (Finnish, Turkish, Herb, Infra and Biosauna, Snow Cave and Russian Bath), солярий \r\n\r\nЛечебное отделение\r\nмедицинский персонал (135 человек в медицинском центре), доктор (40 человек), главная медсестра (1 человек), дежурная сестра, физиотерапевт (14 человек), массажист (43 человека)', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(49, 17, 'Grand Hotel Rogaska', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', '«Grand Hotel Rogaska» является достаточно комфортабельным санаторно-курортным учреждением. Оптимально подойдет курортникам, которые предпочитают хороший уровень сервиса. Санаторий также очень удобен для проживания в холодные месяцы года, когда для прохождения лечебно-оздоровительных процедур в медицинском центре «Рогашка» можно пройти по крытому переходу.', 'Знаменитый отель в классическом стиле, в котором гостили австро-венгерский  император Фердинанд, югославский  король Петр, композитор Франц Лист и другие европейские знаменитости, является гордостью курорта Рогашка Слатина.  Роскошь прошлых лет, современный комфорт, цветущий парк с фонтаном создают неповторимую царскую атмосферу.\r\n\r\n«Гранд отель Рогашка» расположен на центральной аллее курорта Рогашка Слатина. Санаторий имеет собственное лечебно-оздоровительное отделение, в котором гости проходят процедуры. Питьевой курс минеральной воды «Донат Mg» проходит в мед-центре.\r\n\r\nОт «Гранд отель Rogaska» в 3 минутах ходьбы находится комплекс с плавательными бассейнами «Рогашка Ривьера», который гости санатория посещают бесплатно. Комплекс открыт с середины апреля и до конца октября.', 'Вы платите по прибытии в Grand Hotel Rogaska.\r\n\r\nGrand Hotel Rogaska осуществляет временное блокирование 20% стоимости заказа на вашей банковской карте за 7 дней до заезда. Сумма физически не снимается с карты, а только временно блокируется на случай, если вами будет произведена отмена бронирования уже в период действия штрафных санкций.\r\n\r\nGrand Hotel Rogaska принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'маникюр, педикюр, прокат автомобиля, прокат велосипедов, услуги консьержа, услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн (12х5 метров, с термоминеральной водой 31,5 °C - БЕСПЛАТНО), сауна (2 х финская, паровая, инфрасауна - БЕСПЛАТНО ) \r\n\r\nЛечебное отделение\r\nмедицинский персонал (15 человек), доктор (2 человека), главная медсестра (1 человек), медсестра (8 человек), массажист (4 человека)', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(50, 17, 'Grand Hotel Sava', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg"]', '«Grand Hotel Sava» один из самых комфортабельных санаториев на курорте Рогашка Слатина. На очень качественном уровне организовано питание, в том числе диетическое – выбор блюд удовлетворит даже требовательных гостей санатория. Сервис также на очень высоком уровне.', 'Отель находится в зеленом уголке Рогашки Слатины, в окружении цветущего парка. Вас ждут уютные и стильные номера различных категорий, которые были обновлены в 2010 г., где Вы почувствуете себя как дома. Ощутите переплетение элегантности, шарма и королевского комфорта!\r\n\r\n«Гранд Отель Cава» удобно расположен в самом центре курорта Рогашка Слатина, прямо напротив питьевого павильона с лечебными минеральными источниками воды «Donat Mg», с которым он соединен теплым крытым переходом. «Сава» считается одним из самых комфортабельных на курорте.\r\n\r\nЛечение гости проходят в собственном лечебно-оздоровительном отделении гранд отеля «Sava», где проводятся процедуры для лечения опорно-двигательного аппарата, сердечно-сосудистой системы, неврологических заболеваний. \r\n\r\nВ гранд отеле созданы все условия для комфортного отдыха: очень удобные номера, просторный бассейн с термальной минеральной водой, тренажерный зал.', 'Вы платите по прибытии в Grand Hotel Sava.\r\n\r\nGrand Hotel Sava не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nGrand Hotel Sava принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, DCI', 'Парикмахерская, маникюр, педикюр, прокат велосипедов, услуги консьержа, услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн (с термальной минеральной водой, размер 200 м²), термальный бассейн, джакузи (2), сауна (2), солярий, соляная пещера \r\n\r\nЛечебное отделение\r\nмедицинский персонал (9 человек), доктор (1 человек), главная медсестра (1 человек), медсестра (1 человек), дежурная сестра, физиотерапевт (1 человек), массажист (4 человека), диетолог (1 человек)', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(51, 17, 'Спа отель Zagreb', '', '["1.jpg","2.jpg","3.jpg","4.jpg","5.jpg","6.jpg"]', 'Спа отель «Zagreb» является очень удобным для людей, предпочитающих проживать в центре курорта, в непосредственной близости к питьевому павильону с минеральной водой «Донат Mg». Он очень удобен еще и тем, что в холодное время года в питьевой павильон можно пройти из «Загреба» по внутреннему переходу через санаторий «Sava» и медицинский центр «Рогашка». Лечебно-оздоровительные процедуры, которые проводятся в лечебном отделении санатории «Sava», позволяют лечить заболевания опорно-двигательного аппарата.', 'Отель является частью Гранд Отеля Сава и связан с ним переходом. Рецепция и ресторан расположены в отеле Сава.Спа отель «Zagreb» расположен в центре курорта Рогашка Слатина, прямо напротив питьевого бювета с минеральной водой «Donat Mg». \r\n\r\n«Zagreb» в 2015 году прошел комплексную реконструкцию, поэтому является комфортабельным спа отелем.\r\n\r\nЛечение гости спа отеля проходят в лечебном отделении санатория «Sava», в которое из «Загреба» можно пройти по внутреннему переходу, не выходя на улицу.', 'Вы платите по прибытии в Спа отель Zagreb.\r\n\r\nСпа отель Zagreb не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСпа отель Zagreb принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro', 'Парикмахерская, маникюр, педикюр, прокат велосипедов, услуги консьержа, услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн (с термальной минеральной водой, размер 200 м²), термальный бассейн, джакузи (2), сауна (4), солярий, соляная пещера \r\n\r\nЛечебное отделение\r\nмедицинский персонал (9 человек), доктор (1 человек), главная медсестра (1 человек), медсестра (1 человек), дежурная сестра, физиотерапевт (1 человек), массажист (4 человека), диетолог (1 человек)', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(52, 17, 'Спа отель Slovenia', '', '["1.jpg","2.jpg","3.jpg","4.jpg.jpg","5.jpg"]', '«Slovenia» подойдет гостям курорта, предпочитающих отдыхать в небольшом спа отеле, в спокойной обстановке. Уровень комфортабельности и сервиса в спа отеле на хорошем уровне.', 'Отель является настоящей архитектурной жемчужиной Рогашки Слатины. Глаза наслаждаются, любуясь формами и линиями. Помимо удивительно красивой архитектуры и солнечных номеров, гости непременно останутся довольны и отличной кухней отеля.  Отель обновлен в 2013 году.\r\n\r\nСпа отель «Словения» расположен в центре курорта Рогашка Слатина, 3 минуты ходьбы от павильона с минеральной водой «Донат Mg» и медицинского центра «Рогашка», где проводится большинство лечебно-оздоровительных процедур. \r\n\r\nСпа отель имеет собственное небольшое лечебно-оздоровительное отделение, в котором проводятся отдельные процедуры. В спа отеле есть собственный бассейн.\r\n\r\nРядом с спа отелем находится развлекательный комплекс с бассейнами «Рогашка Ривьера»', 'Вы платите по прибытии в Спа отель Slovenia.\r\n\r\nСпа отель Slovenia не осуществляет блокирование средств на вашей банковской карте – вы платите только при заселении. Информация о Вашей банковской карте необходима на случай, если вы аннулируете бронь во время действия штрафных санкций, указанных при бронировании. В этом случае санаторий имеет право снять сумму штрафа с банковской карты.\r\n\r\nСпа отель Slovenia принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, DCI', 'присмотр за детьми, гостиничные услуги, парикмахерская, маникюр, педикюр, прокат автомобиля, прокат велосипедов, услуги консьержа, услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн (с термальной минеральной водой), джакузи, сауна\r\n\r\nЛечебное отделение\r\nмедицинский персонал, доктор, главная медсестра, дежурная сестра, физиотерапевт, массажист, диетолог', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(53, 15, 'Санаторий Terme Metropole', '', '[]', 'Санаторий Terme Metropole хорошо подходит для семейного отдыха из-за наличия собственной парковой зоны, комплекса бассейнов и условий для комфортного пребывания с детьми. В санаторий постоянно много русскоговорящих гостей, что явлется оптимальным для людей, предпочитающих отдыхать в русской языковой среде.', 'Санаторий Terme Metropole **** Superior расположен в тихом месте, в 400 м от центра курорта Абано Терме. \r\n\r\nСанаторий имеет парковую зону площадью около 40.000 м² - это один из самых больших парков в Абано Терме. В парковой зоне санатория расположено поле для мини-гольфа, теннисный корт, две фитнесс-зоны, из которых одна под открытым небом. \r\n\r\nСанаторий Terme Metropole имеет 5 плавательных бассейнов с термальной минеральной водой, из которых один бассейн олимпийского образца с небольшой температурой воды для комфортного активного плавания. Все бассейны оборудованы гидромассажными установками для различных партий тела. \r\n\r\nСанаторий Terme Metropole имеет один из самых лучших на курорте реабилитационных центров, который оснащен самым современным медицинским оборудованием.', 'Санаторий Terme Metropole взимает 100% стоимости заказа с вашей банковской карты за 13 дней до заезда.\r\n\r\nСанаторий Terme Metropole принимает оплату наличными и банковские карты: VISA, Mastercard, Maestro, American Express, JCB, DCI', 'обмен валют, присмотр за детьми, гостиничные услуги, парикмахерская, маникюр, педикюр, прокат автомобиля, прокат велосипедов, услуги консьержа, услуги чистки одежды, услуги по глажке одежды \r\n\r\nСпа и Велнес\r\nбассейн, термальный бассейн, джакузи, сауна, солярий \r\n\r\nЛечебное отделение\r\nмедицинский персонал, доктор, педиатр (по запросу), физиотерапевт (по запросу), массажист (по запросу), диетолог (по запросу)', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0),
(54, 10, '   DVORAK ', '', '[]', '', '', '', '', '', '', NULL, NULL, NULL, NULL, 4, 0, 0, 0);
